  "1944": { name: "\u4eba\u65cf\u6230\u7565 \u2027 \u5149", description: "\u5168\u968a\u56de\u5fa9\u529b\u6e1b\u5c11 50%\uff1b\u5149\u5c6c\u6027\u653b\u64ca\u529b 1.5 \u500d\uff0c\u7576\u968a\u4f0d\u4e2d\u53ea\u6709\u4eba\u985e\u6210\u54e1\u6642\uff0c\u5149\u5c6c\u6027\u653b\u64ca\u529b\u984d\u5916\u63d0\u5347 1.3 \u500d (\u6548\u679c\u6703\u5728\u95dc\u9589\u6b64\u6280\u80fd\u6216\u6b7b\u4ea1\u5f8c\u6d88\u5931)" },
  "1945": { name: "\u751c\u871c\u6bba\u6a5f", description: "1 \u56de\u5408\u5167\uff0c\u968a\u4f0d\u4e2d\u653b\u64ca\u529b\u6700\u9ad8 (\u6700\u5de6\u65b9) \u7684\u5149\u5c6c\u6027\u6210\u54e1\u653b\u64ca\u529b 10 \u500d" },
