  "2105": { name: "\u7a7f\u9b42\u4e4b\u529b \u2027 \u6a5f\u68b0", description: "\u6728\u5c6c\u6027\u53ca\u6a5f\u68b0\u65cf\u653b\u64ca\u529b 1.8 \u500d\uff0c\u82e5\u767c\u52d5\u6280\u80fd\u6642\u81ea\u8eab\u884c\u52d5\u503c\u9054\u81f3 100%\uff0c\u653b\u64ca\u529b\u63d0\u5347\u81f3 2.2 \u500d\uff1b\u968a\u4f0d\u4e2d\u82e5\u6709 3 \u500b\u6216\u4ee5\u4e0a\u6a5f\u68b0\u65cf\u6210\u54e1\uff0c\u5fc5\u7136\u5ef6\u9577\u79fb\u52d5\u7b26\u77f3\u6642\u9593 3 \u79d2\u3002\u6548\u679c\u6703\u5728\u9032\u5165\u4e0b\u4e00\u5c64\u6578 (Wave) \u6642\u6d88\u5931" },
  "2106": { name: "\u5e7d\u9b42\u516b\u5366\u9663", description: "\u9ede\u9078\u5143\u7d20\u6cd5\u9663\u4e0a\u7684 1 \u7c92\u7b26\u77f3\uff0c\u4e26\u5c07\u8a72\u7a2e\u7b26\u77f3\u5f15\u7206\uff0c\u4ee5\u6389\u843d\u6697\u795e\u65cf\u5f37\u5316\u7b26\u77f3\u30021 \u56de\u5408\u5167\uff0c\u6697\u7b26\u77f3\u517c\u5177 50% \u5176\u4ed6\u5c6c\u6027\u7b26\u77f3\u6548\u679c" },
  "2107": { name: "\u6975\u9650\u89e3\u653e \u2027 \u6d6a\u6fe4\u885d\u64ca", description: "\u6c34\u7b26\u77f3\u8f49\u5316\u70ba\u6c34\u5f37\u5316\u7b26\u77f3\u3002\u5f15\u7206\u6c34\u4ee5\u5916\u7684\u7b26\u77f3\u9020\u6210\u6575\u65b9\u5168\u9ad4\u6c34\u5c6c\u6027\u50b7\u5bb3\uff1b\u4e26\u63d0\u9ad8\u6c34\u5c6c\u6027\u653b\u64ca\u529b\u53ca\u56de\u5fa9\u529b\uff1a\u5f15\u7206\u7684\u7b26\u77f3\u6108\u591a\uff0c\u6c34\u5c6c\u6027\u653b\u64ca\u529b\u53ca\u56de\u5fa9\u529b\u63d0\u5347\u6108\u591a\uff0c20 \u7c92\u53ef\u9054\u81f3\u6700\u9ad8 2 \u500d" },
