  "2116": { name: "\u7d42\u6975\u4e4b\u5224 \u2027 \u6697", description: "\u5c07 3 \u7c92\u7b26\u77f3\u8f49\u5316\u70ba\u6697\u5f37\u5316\u7b26\u77f3\u3002\u767c\u52d5\u6280\u80fd\u6642\uff0c\u82e5\u6575\u65b9\u5168\u9ad4\u5747\u70ba\u5149\u5c6c\u6027\uff0c1 \u56de\u5408\u5167\uff0c\u63d0\u5347\u6697\u5c6c\u6027\u5c0d\u5149\u5c6c\u6027\u76ee\u6a19\u7684\u653b\u64ca\u529b\uff1b\u53cd\u4e4b\uff0c\u5c07\u6575\u65b9\u5168\u9ad4\u8f49\u70ba\u5149\u5c6c\u6027" },
  "2117": { name: "\u53cd\u64ca\u6027\u7a69\u5b9a\u5b9a\u5411\u5668", description: "\u96a8\u6a5f\u5c07\u7b26\u77f3\u8f49\u5316\u70ba\u6c34\u5f37\u5316\u7b26\u77f3\uff0c\u76f4\u81f3\u5834\u4e0a\u6709 20 \u7c92\u6c34\u5f37\u5316\u7b26\u77f3\u70ba\u6b62\u30023 \u56de\u5408\u5167\uff0c\u6a5f\u68b0\u65cf\u3001\u7378\u985e\u53ca\u9b54\u65cf\u653b\u64ca\u529b\u53ca\u56de\u5fa9\u529b 2 \u500d" },
  "2119": { name: "\u6200\u7126\u6200\u9396\u96fb\u5831", description: "\u5fc3\u7b26\u77f3\u8f49\u5316\u70ba\u706b\u4eba\u65cf\u5f37\u5316\u7b26\u77f3\uff0c\u4e26\u5f15\u7206\u5834\u4e0a\u6240\u6709\u6c34\u53ca\u5149\u7b26\u77f3\u4ee5\u63d0\u5347\u706b\u5c6c\u6027\u653b\u64ca\u529b\uff0c\u5f15\u7206 8 \u7c92\u53ef\u9054\u81f3\u6700\u5927 1.8 \u500d (\u500d\u653b\u6548\u679c\u6301\u7e8c 2 \u56de\u5408)\uff1b2 \u56de\u5408\u5167\uff0c\u5fc3\u7b26\u77f3\u7684\u6389\u843d\u7387\u964d\u81f3 0\uff0c\u4e26\u5c07\u539f\u6709\u6a5f\u7387\u589e\u52a0\u81f3\u706b\u7b26\u77f3\u7684\u6389\u843d\u7387\uff0c\u6389\u843d\u7684\u706b\u7b26\u77f3\u4ee5\u706b\u5f37\u5316\u7b26\u77f3\u4ee3\u66ff" },
  "2120": { name: "\u6700\u7d42\u7fe0\u68b0\u884c\u52d5\u7db1\u9818", description: "\u6c34\u53ca\u706b\u7b26\u77f3\u8f49\u5316\u70ba\u5fc3\u5f37\u5316\u7b26\u77f3\u3002\u5f15\u7206\u5834\u4e0a\u6240\u6709\u5149\u53ca\u6697\u7b26\u77f3\u4ee5\u6389\u843d\u6c34\u5f37\u5316\u3001\u706b\u5f37\u5316\u53ca\u6728\u5f37\u5316\u7b26\u77f3\uff1b\u5f15\u7206 1 \u7c92\u7b26\u77f3\u53ef\u6e1b\u5c11 4% \u6240\u53d7\u50b7\u5bb3\uff0c\u5f15\u7206 10 \u7c92\u53ef\u6e1b\u5c11\u6700\u591a 40% \u6240\u53d7\u50b7\u5bb3 (\u6e1b\u50b7\u6548\u679c\u6301\u7e8c 2 \u56de\u5408)\u30022 \u56de\u5408\u5167\uff0c\u5ef6\u9577\u79fb\u52d5\u7b26\u77f3\u6642\u9593\u81f3 8 \u79d2" },
  "2122": { name: "\u5104\u96f7\u63a5\u96fb \u8108\u885d\u611f\u61c9", description: "\u6728\u7b26\u77f3\u8f49\u5316\u70ba\u5149\u5f37\u5316\u7b26\u77f3\uff1b1 \u56de\u5408\u5167\uff0c\u9996\u6279\u6389\u843d\u7684 15 \u7c92\u7b26\u77f3\u5fc5\u5b9a\u70ba\u5149\u4eba\u65cf\u7b26\u77f3" },
  "2123": { name: "\u767d\u65e5\u5922\u6355\u624b", description: "\u5f15\u7206\u5834\u4e0a\u6240\u6709\u975e\u5f37\u5316\u7b26\u77f3\u4ee5\u6389\u843d\u5c6c\u6027\u5f37\u5316\u7b26\u77f3\u30022 \u56de\u5408\u5167\uff0c\u6e1b\u5c11 40% \u6240\u53d7\u50b7\u5bb3\uff0c\u81ea\u8eab\u5c0d\u795e\u65cf\u76ee\u6a19\u653b\u64ca\u529b\u63d0\u5347 3 \u500d" },
  "2124": { name: "\u5713\u6708\u5e7b\u661f\u821e", description: "\u5f15\u7206\u5834\u4e0a\u6240\u6709\u7b26\u77f3\u4ee5\u6389\u843d\u706b\u4ee5\u5916\u7684\u7b26\u77f3\uff1b1 \u56de\u5408\u5167\uff0c\u6389\u843d\u7684\u6c34\u53ca\u5fc3\u7b26\u77f3\u5206\u5225\u4ee5\u6c34\u5f37\u5316\u53ca\u5fc3\u5f37\u5316\u7b26\u77f3\u4ee3\u66ff" },
  "2125": { name: "\u7d55\u5c0d\u96f6\u5ea6", description: "\u5c07 8 \u7c92\u5fc3\u4ee5\u5916\u7684\u7b26\u77f3\u8f49\u5316\u70ba\u5fc3\u5f37\u5316\u7b26\u77f3\u30021 \u56de\u5408\u5167\uff0c\u9996\u6279\u6389\u843d\u7684\u7b26\u77f3\u5fc5\u5b9a\u70ba\u6c34\u3001\u5149\u53ca\u6697\u7b26\u77f3\uff0c\u7576\u4e2d\u6389\u843d\u7684\u6c34\u7b26\u77f3\u4ee5\u6c34\u5f37\u5316\u7b26\u77f3\u4ee3\u66ff\u3002\u53f3\u65c1\u6210\u54e1\u7684\u4e3b\u52d5\u6280\u80fd CD \u6e1b\u5c11 1" },
  "2126": { name: "\u83ef\u6c0f\u7684\u6975\u71b1", description: "\u300cX \u578b\u300d\u5f15\u7206 10 \u500b\u56fa\u5b9a\u4f4d\u7f6e\u7684\u7b26\u77f3\u4ee5\u6389\u843d\u706b\u5f37\u5316\u7b26\u77f3\u30022 \u56de\u5408\u5167\uff0c\u6e1b\u5c11 30% \u6240\u53d7\u50b7\u5bb3\uff0c\u5fc3\u7b26\u77f3\u7684\u6389\u843d\u7387\u964d\u81f3 0\uff0c\u4e26\u5c07\u539f\u6709\u6a5f\u7387\u589e\u52a0\u81f3\u706b\u7b26\u77f3\u7684\u6389\u843d\u7387" },
  "2127": { name: "\u7dba\u714c\u7684\u6df1\u5c64 \u2027 \u4e16\u754c", description: "\u6c34\u3001\u706b\u53ca\u6728\u7b26\u77f3\u8f49\u5316\u70ba\u5fc3\u5f37\u5316\u7b26\u77f3\uff0c\u6697\u7b26\u77f3\u8f49\u5316\u70ba\u5149\u7b26\u77f3\u30021 \u56de\u5408\u5167\uff0c\u4ee5\u56de\u5fa9\u7684\u751f\u547d\u529b\u7b49\u503c\u5c0d\u5168\u9ad4\u6575\u4eba\u9020\u6210\u7121\u5c6c\u6027\u50b7\u5bb3\uff0c\u6b64\u50b7\u5bb3\u7121\u8996\u9632\u79a6\u529b" },
