  "2209": { name: "\u731c\u731c\u62f3", description: "1 \u56de\u5408\u5167\uff0c\u4ee5\u6307\u5b9a\u5716\u793a\u7684\u7b26\u77f3\u958b\u59cb\u8f49\u73e0\u6642\uff0c\u5c07\u89f8\u767c\u4ee5\u4e0b\u6548\u679c\uff1a\n\u526a\u5200\uff1a\u5168\u968a\u653b\u64ca\u529b\u53ca\u56de\u5fa9\u529b 1.6 \u500d\uff1b\n\u77f3\u982d\uff1a\u81ea\u8eab\u653b\u64ca\u529b 7 \u500d\uff0c\u81ea\u8eab\u653b\u64ca\u7121\u8996\u6575\u4eba\u7684\u9632\u79a6\u529b\uff1b\n\u5e03\uff1a\u65bc\u767c\u52d5\u653b\u64ca\u524d\u4ee5 30 \u500d\u81ea\u8eab\u653b\u64ca\u529b\u5c0d\u6575\u65b9\u5168\u9ad4\u9020\u6210\u6728\u5c6c\u6027\u50b7\u5bb3" },
