  "2211": { name: "\u96fb\u5149\u77f3\u706b", description: "\u6240\u6709\u7b26\u77f3\u8f49\u5316\u70ba\u5f37\u5316\u7b26\u77f3\uff0c\u6697\u7b26\u77f3\u7531\u5de6\u4e0a\u65b9\u958b\u59cb\u5411\u53f3\u6392\u5217\uff1b1 \u56de\u5408\u5167\uff0c\u9023\u64ca (Combo) \u6578\u76ee\u589e\u52a0 5" },
