  "2215": { name: "\u62d6\u5ef6\u8853", description: "1 \u56de\u5408\u5167\uff0c\u81ea\u8eab\u4e0d\u80fd\u5c0d\u6575\u65b9\u9020\u6210\u50b7\u5bb3\uff0c\u6e1b\u5c11 20% \u6240\u53d7\u50b7\u5bb3\uff1b\u4e0b\u56de\u5408\u958b\u59cb\u6642\uff0c\u96a8\u6a5f 3 \u500b\u4eba\u985e\u6210\u54e1\u6240\u5728\u76f4\u884c\u7684\u7b26\u77f3\u8f49\u5316\u70ba\u8a72\u6210\u54e1\u5c6c\u6027\u7684\u7b26\u77f3" },
  "2217": { name: "\u7099\u71b1\u722a\u64ca \u2027 \u5f37", description: "\u5c07 10 \u500b[board=AAEBAAYFCdKEqUoA]\u56fa\u5b9a\u4f4d\u7f6e[/board]\u7684\u7b26\u77f3\u8f49\u5316\u70ba\u706b\u5f37\u5316\u7b26\u77f3\u30021 \u56de\u5408\u5167\uff0c\u706b\u5c6c\u6027\u653b\u64ca\u529b 2 \u500d\uff0c\u706b\u5c6c\u6027\u7378\u985e\u53ca\u7378\u985e\u653b\u64ca\u529b 3 \u500d" },
  "2218": { name: "\u68ee\u91ce\u4e4b\u529b \u2027 \u5f37", description: "1 \u56de\u5408\u5167\uff0c\u6728\u5c6c\u6027\u53ca\u7378\u985e\u653b\u64ca\u529b 1.5 \u500d\uff0c\u6728\u5c6c\u6027\u7378\u985e\u653b\u64ca\u529b\u5247\u63d0\u5347\u81f3 1.8 \u500d" },
  "2219": { name: "\u75be\u8d70\u7121\u5f71 \u2027 \u7378", description: "\u5b8c\u5168\u56de\u5fa9\u751f\u547d\u529b\u30021 \u56de\u5408\u5167\uff0c\u8ff4\u907f\u6240\u6709\u653b\u64ca\uff1b2 \u56de\u5408\u5167\uff0c\u6240\u6709\u7b26\u77f3\u517c\u5177\u968a\u4f0d\u4e2d\u7378\u985e\u6210\u54e1\u5c6c\u6027\u6548\u679c" },
  "2220": { name: "\u9e92\u9e9f\u4e4b\u50b2 \u2027 \u5f37", description: "1 \u56de\u5408\u5167\uff0c\u8ff4\u907f\u6240\u6709\u6575\u4eba\u7684\u653b\u64ca\u3002\u4e0b\u56de\u5408\u958b\u59cb\u524d\uff0c\u6240\u6709\u7b26\u77f3\u8f49\u5316\u70ba\u9f8d\u65cf\u5f37\u5316\u7b26\u77f3\uff0c\u5168\u968a\u653b\u64ca\u529b 1.5 \u500d" },
  "2222": { name: "\u9b45\u5f71\u8853 \u2027 \u7149", description: "\u5c07 4 \u81f3 7 \u7c92\u7b26\u77f3\u8f49\u5316\u70ba\u6697\u5f37\u5316\u7b26\u77f3 (\u6c34\u3001\u706b\u53ca\u6728\u7b26\u77f3\u512a\u5148\u8f49\u63db)\uff1b\u82e5\u968a\u4f0d\u4e2d\u6709 4 \u500b\u4ee5\u4e0a\u9f8d\u985e\u6210\u54e1\u6642\uff0c\u8f49\u5316 7 \u7c92\u6697\u5f37\u5316\u7b26\u77f3\u7684\u6a5f\u7387\u5927\u5e45\u63d0\u5347" },
  "2223": { name: "\u4fee\u7f85\u65cb\u98a8\u62f3", description: "\u6240\u6709\u6728\u7b26\u77f3\u7531\u5de6\u4e0a\u65b9\u958b\u59cb\u5411\u4e0b\u6392\u5e8f\u30021 \u56de\u5408\u5167\uff0c\u6bcf\u76f4\u884c\u9996\u6279\u6d88\u9664 1 \u7d44 5 \u7c92\u6216\u4ee5\u4e0a\u7b26\u77f3\u6642\uff0c\u8a72\u76f4\u884c\u5c07\u6389\u843d 2 \u7c92\u6728\u5996\u65cf\u7b26\u77f3" },
  "2224": { name: "\u6028\u547c\u969c\u7e1b\u58c1", description: "\u6c34\u7b26\u77f3\u8f49\u5316\u70ba\u5996\u65cf\u5f37\u5316\u7b26\u77f3\uff1b1 \u56de\u5408\u5167\uff0c\u6d88\u9664\u5996\u65cf\u7b26\u77f3\u6642\uff0c\u5996\u7cbe\u985e\u653b\u64ca\u529b 1.5 \u500d" },
  "2225": { name: "\u51b0\u4e4b\u6dda", description: "1 \u56de\u5408\u5167\uff0c\u51cd\u7d50\u6575\u65b9\u5168\u9ad4\uff0c\u4f7f\u53d7\u5f71\u97ff\u76ee\u6a19\u7121\u6cd5\u884c\u52d5\u4e26\u8f49\u70ba\u6c34\u5c6c\u6027\uff0c\u6548\u679c\u671f\u9593\u5fc5\u7136\u5ef6\u9577\u79fb\u52d5\u7b26\u77f3\u6642\u9593 5 \u79d2" },
  "2226": { name: "\u529b\u91cf\u8ff8\u767c\u7684\u5951\u6a5f \u2027 \u6a5f\u68b0", description: "\u5c07\u7d2f\u7a4d\u6230\u9b25\u56de\u5408 (\u9700\u8981\u6d88\u9664\u7b26\u77f3) +1 \u6578\u91cf\u7684\u7b26\u77f3\u8f49\u5316\u70ba\u81ea\u8eab\u5c6c\u6027\u7b26\u77f3\uff0c\u6700\u591a 6 \u7c92\uff1b\u82e5\u968a\u4f0d\u4e2d\u6709 3 \u500b\u6216\u4ee5\u4e0a\u6a5f\u68b0\u65cf\u6210\u54e1\u6642\uff0c\u5247\u8f49\u5316\u70ba\u81ea\u8eab\u5c6c\u6027\u6a5f\u68b0\u65cf\u7b26\u77f3\u3002\u7576\u7d2f\u7a4d\u81f3\u6700\u591a 6 \u7c92\u6642\u767c\u52d5\u6280\u80fd\uff0c\u81ea\u8eab\u653b\u64ca\u529b 2 \u500d\u3002\u767c\u52d5\u6280\u80fd\u5f8c\u53ef\u8f49\u63db\u7b26\u77f3\u6578\u91cf\u5c07\u91cd\u65b0\u7d2f\u7a4d" },
  "2227": { name: "\u7384\u51a5\u7d55\u5875 \u2027 \u805a\u9748", description: "\u5f15\u7206\u5149\u53ca\u6697\u7b26\u77f3\u4ee5\u6389\u843d\u5f37\u5316\u7b26\u77f3\uff1b2 \u56de\u5408\u5167\uff0c\u79fb\u52d5\u7b26\u77f3\u5f8c\u5149\u53ca\u6697\u7b26\u77f3\u7684\u6389\u843d\u7387\u964d\u81f3 50%\uff0c\u4e26\u5c07\u539f\u6709\u6a5f\u7387\u589e\u52a0\u81f3\u5fc3\u7b26\u77f3\u7684\u6389\u843d\u7387" },
  "2228": { name: "\u7d55\u547d\u5371\u6a5f", description: "I. \u81ea\u8eab\u751f\u547d\u529b\u6263\u81f3 1\n1 \u56de\u5408\u5167\nII. \u5c07\u88ab\u6e1b\u53bb\u7684\u751f\u547d\u529b\n\u21d2 \u52a0\u5165\u81ea\u8eab\u653b\u64ca\u529b\u57fa\u503c\n(\u653b\u64ca\u529b\u4e0d\u53ef\u8207\u5176\u4ed6\u6210\u54e1\u5171\u4eab)" },
  "2229": { name: "\u7121\u6b62\u7149\u7344", description: "\u6bcf\u9996\u6279\u6d88\u9664 1 \u7d44\u706b\u5c6c\u6027\u7684\u9023\u64ca (Combo) \u6642\uff0c\u500b\u4eba\u8ffd\u6253\u706b\u5c6c\u6027\u653b\u64ca 1 \u6b21\uff0c\u4e26\u65bc\u4e0b\u56de\u5408\u958b\u59cb\u6642\u5c07 1 \u7c92\u7b26\u77f3\u8f49\u5316\u70ba\u706b\u7b26\u77f3\uff0c\u6700\u591a\u8ffd\u6253 4 \u6b21\u53ca\u8f49\u5316 4 \u7c92\uff1b\u6548\u679c\u6301\u7e8c\u81f3\u6c92\u6709\u9996\u6279\u6d88\u9664 4 \u7c92\u6216\u4ee5\u4e0a\u706b\u7b26\u77f3" },
  "2230": { name: "\u6d41\u6c34\u90aa\u8853", description: "\u6700\u9802 1 \u6a6b\u884c\u7684\u7b26\u77f3\u8f49\u5316\u70ba\u5fc3\u7b26\u77f3\uff0c\u6700\u53f3\u65b9 1 \u76f4\u884c\u7684 4 \u7c92\u7b26\u77f3\u8f49\u5316\u70ba\u6c34\u5996\u65cf\u7b26\u77f3" },
  "2231": { name: "\u9748\u4e38", description: "\u5c07 9 \u7c92\u7b26\u77f3\u8f49\u5316\u70ba 3 \u7c92\u6c34\u5f37\u5316\u30013 \u7c92\u5149\u5f37\u5316\u53ca 3 \u7c92\u5fc3\u5f37\u5316\u7b26\u77f3\u30021 \u56de\u5408\u5167\uff0c\u5408\u8a08\u6d88\u9664\u7684\u6c34\u3001\u5149\u6216\u5fc3\u7b26\u77f3\u6108\u591a\uff0c\u81ea\u8eab\u653b\u64ca\u529b\u6108\u9ad8\uff0c\u6d88\u9664 15 \u7c92\u53ef\u63d0\u5347\u81f3\u6700\u5927 7 \u500d" },
  "2232": { name: "\u6012\u865f", description: "\u9996\u6279\u6d88\u9664 5 \u7c92\u6216\u4ee5\u4e0a\u6697\u7b26\u77f3\uff0c\u81ea\u8eab\u653b\u64ca\u529b 5.5 \u500d\uff0c\u5176\u5f8c\u6bcf\u56de\u5408\u9700\u8981\u9996\u6279\u6d88\u9664\u7684\u6697\u7b26\u77f3\u6578\u91cf +1\uff0c\u9054\u6210\u689d\u4ef6\u6642\u81ea\u8eab\u653b\u64ca\u529b\u984d\u5916\u63d0\u5347 1.5 \u500d\uff0c\u6700\u5927 10 \u500d\u3002\u6548\u679c\u6301\u7e8c\u81f3\u6c92\u6709\u9054\u6210\u689d\u4ef6" },
