  "2373": { name: "\u7528\u51b0\u4e4b\u9053", description: "1 \u56de\u5408\u5167\uff0c\u81ea\u8eab\u4e0d\u80fd\u5c0d\u6575\u65b9\u9020\u6210\u50b7\u5bb3\uff0c\u6240\u53d7\u50b7\u5bb3\u6e1b\u5c11 60%\uff1b\u4e0b\u56de\u5408\u5176\u4ed6\u7b26\u77f3\u517c\u5177 150% \u6c34\u7b26\u77f3\u6548\u679c" },
  "2374": { name: "\u7206\u88c2\u9b54\u6cd5", description: "\u6700\u9802\u53ca\u6700\u5e95 1 \u6a6b\u884c\u7684\u7b26\u77f3\u8f49\u5316\u70ba\u706b\u5f37\u5316\u7b26\u77f3\uff1b\u5c0d\u6575\u65b9\u5168\u9ad4\u9020\u6210 800 \u842c\u706b\u5c6c\u6027\u50b7\u5bb3\uff0c\u6b64\u50b7\u5bb3\u7121\u8996\u9632\u79a6\u529b\u53ca\u5f37\u5316\u7a81\u7834\u6575\u6280\u3002\u56de\u5408\u7d50\u675f\u6642\uff0c\u81ea\u8eab\u9032\u5165 1 \u56de\u5408\u75b2\u618a\u72c0\u614b" },
  "2375": { name: "\u7206\u88c2\u9b54\u6cd5 \u2027 \u771f\u7d05\u7684\u91d1\u5149", description: "\u55ae\u6578\u6a6b\u884c\u7684\u7b26\u77f3\u8f49\u5316\u70ba\u706b\u5f37\u5316\u7b26\u77f3\uff1b\u5c0d\u6575\u65b9\u5168\u9ad4\u9020\u6210 1000 \u842c\u706b\u5c6c\u6027\u50b7\u5bb3\uff0c\u6b64\u50b7\u5bb3\u7121\u8996\u9632\u79a6\u529b\u53ca\u5f37\u5316\u7a81\u7834\u6575\u6280\u3002\u56de\u5408\u7d50\u675f\u6642\uff0c2 \u56de\u5408\u5167\u81ea\u8eab\u9032\u5165\u75b2\u618a\u72c0\u614b\u53ca\u300c\u83ef\u9e97\u7206\u88c2 \u2027 \u60e0\u60e0\u300d\u4ee5\u5916\u4eba\u985e\u53ca\u795e\u65cf\u6210\u54e1\u9032\u5165\u4ea2\u596e\u72c0\u614b\u3002\u767c\u52d5\u6b64\u6280\u80fd\u6642\u9700\u5132\u6eff\u9f8d\u8108\u5100\u53ca\u8a72\u56de\u5408\u4e0d\u80fd\u767c\u52d5\u9f8d\u523b\u8108\u52d5" },
  "2377": { name: "\u5805\u5fcd\u7684\u76fe\u724c", description: "\u5fc3\u7b26\u77f3\u7684\u6389\u843d\u7387\u964d\u81f3 0\uff0c\u4e26\u5c07\u539f\u6709\u6a5f\u7387\u589e\u52a0\u81f3\u5149\u7b26\u77f3\u7684\u6389\u843d\u7387\uff1b\u6e1b\u5c11 15% \u6240\u53d7\u50b7\u5bb3\uff0c\u6bcf\u6b21\u53d7\u5230\u6575\u4eba\u653b\u64ca\uff0c\u6e1b\u50b7\u6548\u679c\u5c07\u63d0\u5347 10%\uff0c\u6700\u591a\u53ef\u6e1b\u50b7 35% (\u6548\u679c\u6703\u5728\u95dc\u9589\u6b64\u6280\u80fd\u6216\u6b7b\u4ea1\u5f8c\u6d88\u5931)\u3002\u6b64\u6280\u80fd\u53ef\u96a8\u6642\u95dc\u9589\uff0c\u95dc\u9589\u6642\uff0c\u96a8\u6a5f\u5c07 8 \u7c92\u7b26\u77f3\u8f49\u5316\u70ba\u5fc3\u7b26\u77f3" },
  "2379": { name: "\u5077\u7aca", description: "\u5f15\u7206\u300c\u7f8e\u597d\u4e16\u754c\u300d\u7cfb\u5217\u6210\u54e1\u76f4\u884c\u7684\u7b26\u77f3\u4ee5\u6389\u843d\u5f37\u5316\u7b26\u77f3\uff0c\u4e26\u96a8\u6a5f\u7372\u5f97\u4ee5\u4e0b\u4e00\u500b\u6548\u679c\u3002\n\u528d\uff1a1 \u56de\u5408\u5167\uff0c\u5168\u968a\u653b\u64ca\u529b 1.8 \u500d\uff1b\n\u80d6\u6b21\uff1a1 \u56de\u5408\u5167\uff0c\u5168\u968a\u653b\u64ca\u529b\u53ca\u56de\u5fa9\u529b 2 \u500d" },
  "2380": { name: "\u5492\u6028\u6676\u7344", description: "\u81ea\u8eab\u653b\u64ca\u529b 1.5 \u500d\uff0c\u82e5\u968a\u4f0d\u4e2d\u6709 3 \u500b\u6216\u4ee5\u4e0a\u5c6c\u6027\u6210\u54e1\u6642\uff0c\u81ea\u8eab\u653b\u64ca\u8f49\u5316\u70ba\u6c34\u5c6c\u6027\u53ca\u81ea\u8eab\u653b\u64ca\u529b\u63d0\u5347\u81f3 3.5 \u500d (\u6548\u679c\u6703\u5728\u95dc\u9589\u6b64\u6280\u80fd\u6216\u6b7b\u4ea1\u5f8c\u6d88\u5931)\u3002\u6280\u80fd\u95dc\u9589\u6642\uff0c\u51cd\u7d50\u6575\u65b9\u5168\u9ad4\uff0c\u4f7f\u53d7\u5f71\u97ff\u76ee\u6a19\u7121\u6cd5\u884c\u52d5\u4e26\u8f49\u70ba\u6c34\u5c6c\u6027\uff0c\u6301\u7e8c 1 \u56de\u5408" },
  "2381": { name: "\u5df4\u5c3c\u723e\u5f0f\u6bba\u4eba\u5149\u7dda", description: "\u5c07 6 \u7c92\u7b26\u77f3\u8f49\u5316\u70ba\u6697\u9b54\u65cf\u7b26\u77f3 (\u6697\u53ca\u5fc3\u4ee5\u5916\u7b26\u77f3\u512a\u5148\u8f49\u63db)\uff1b\u5c0d\u55ae\u4e00\u6575\u4eba\u9020\u6210 80000 \u9ede\u706b\u5c6c\u6027\u50b7\u5bb3\uff0c\u6b64\u50b7\u5bb3\u7121\u8996\u9632\u79a6\u529b" },
  "2382": { name: "\u65e5\u5195\u7926\u77f3", description: "1 \u56de\u5408\u5167\uff0c\u500b\u4eba\u8ffd\u6253\u81ea\u8eab\u653b\u64ca\u529b 1.5 \u500d\u7684\u96a8\u6a5f\u5c6c\u6027\u653b\u64ca 1 \u81f3 5 \u6b21\uff0c\u81ea\u8eab\u884c\u52d5\u503c\u9054 100% \u6642\uff0c\u5fc5\u5b9a\u8ffd\u6253 5 \u6b21\u3002\u968a\u4f0d\u4e2d\u6bcf\u591a 1 \u500b\u6a5f\u68b0\u65cf\u6210\u54e1\u53ef\u984d\u5916\u589e\u52a0 1 \u56de\u5408\u6548\u679c\uff0c\u6700\u591a\u6301\u7e8c 6 \u56de\u5408" },
