  "2400": { name: "\u878d\u51b0\u7684\u529b\u91cf", description: "I. \u5f15\u7206\u6240\u6709\u51cd\u7d50\u7b26\u77f3\n1 \u56de\u5408\u5167\nII. \u5168\u968a\u653b\u64ca\u529b 1.8 \u500d\nIII. \u5ef6\u9577\u79fb\u52d5\u7b26\u77f3\u6642\u9593\u81f3 12 \u79d2" },
  "2401": { name: "\u9b54\u6027\u8513\u5ef6", description: "I. \u6bcf\u56de\u5408\u96a8\u6a5f\u5c07 3 \u7c92\u7b26\u77f3\n\u21d2 \u8f49\u5316\u70ba\u9b54\u65cf\u5f37\u5316\u7b26\u77f3\nII. \u9b54\u65cf\u6210\u54e1\u767c\u52d5\u653b\u64ca\u6642\n\u21d2 \u8a72\u6210\u54e1\u984d\u5916\u8ffd\u6253 1 \u6b21\n\u6548\u679c\u6301\u7e8c\u81f3\u6c92\u6709\u6d88\u9664\u9b54\u65cf\u7b26\u77f3" },
