  "2403": { name: "\u9b54\u8853\u7684\u529b\u91cf", description: "2 \u56de\u5408\u5167\nI. \u5149\u5c6c\u6027\u53ca\u9b54\u65cf\u653b\u64ca\u529b 2 \u500d\nII. \u82e5\u968a\u4f0d\u4e2d\u53ea\u6709\u9b54\u65cf\u6210\u54e1\u6642\n\u21d2 \u7121\u8996\u5168\u9ad4\u6575\u4eba\u7684\u9632\u79a6\u529b" },
  "2404": { name: "\u7a0b\u5e8f\u4fee\u6b63", description: "I. 12 \u79d2\u5167\uff0c\u53ef\u4efb\u610f\u79fb\u52d5\u7b26\u77f3\n   \u800c\u4e0d\u6703\u767c\u52d5\u6d88\u9664\n1 \u56de\u5408\u5167\nII. \u6697\u7b26\u77f3\u517c\u5177 50% \u5176\u4ed6\u5c6c\u6027\u7b26\u77f3\u6548\u679c" },
  "2405": { name: "\u79d8\u5bc6\u7684\u7d04\u5b9a", description: "\u968a\u4f0d\u4e2d\u53ea\u6709\u4eba\u985e\u6216\u795e\u65cf\u6642\uff0c\u4e0b\u4e00\u6b21\u6240\u53d7\u50b7\u5bb3\u4e0d\u6703\u4f7f\u4f60\u6b7b\u4ea1\uff0c\u4e26\u65bc\u8a72\u56de\u5408\u7d50\u675f\u6642\u5b8c\u5168\u56de\u5fa9\u751f\u547d\u529b" },
  "2407": { name: "\u6b7b\u4ea1\u5ba3\u544a", description: "\u5c0d 1 \u500b\u4eba\u985e\u6575\u4eba\u65bd\u4ee5\u8a5b\u5492\uff1a\u6bcf\u56de\u5408\u6d88\u8017\u6575\u4eba 15% \u7e3d\u751f\u547d\u529b\uff0c\u6548\u679c\u6301\u7e8c\u81f3\u53d7\u5230\u6575\u4eba\u653b\u64ca" },
  "2408": { name: "\u6280\u80fd\u5c01\u5370", description: "\u6697\u3001\u5149\u53ca\u5fc3\u7b26\u77f3\u5206\u5225\u8f49\u5316\u70ba\u6c34\u5f37\u5316\u3001\u706b\u5f37\u5316\u53ca\u6728\u5f37\u5316\u7b26\u77f3\uff1b1 \u56de\u5408\u5167\uff0c\u81ea\u8eab\u5c0d\u9b54\u65cf\u653b\u64ca\u529b\u63d0\u5347 5 \u500d" },
  "2409": { name: "\u9b54\u528d\u683c\u62c9\u58a8", description: "\u5f15\u7206\u81ea\u8eab\u3001\u968a\u9577\u53ca\u6230\u53cb\u76f4\u884c\u7684\u7b26\u77f3\uff1b1 \u56de\u5408\u5167\uff0c\u82e5\u5834\u4e0a\u6709\u5176\u4ed6\u9644\u52a0\u6548\u679c\u6642\uff0c\u5168\u968a\u653b\u64ca\u529b 2 \u500d" },
  "2410": { name: "\u9b54\u528d\u683c\u62c9\u58a8 \u2027 \u5f37", description: "\u9ede\u9078\u5143\u7d20\u6cd5\u9663\u4e0a\u7684 1 \u7c92\u7b26\u77f3\uff0c\u4e26\u5c07\u8a72\u7a2e\u7b26\u77f3\u5f15\u7206\uff0c\u4ee5\u6389\u843d\u8a72\u7a2e\u7b26\u77f3\u4ee5\u5916\u7684\u7b26\u77f3\u30021 \u56de\u5408\u5167\uff0c\u82e5\u5834\u4e0a\u6709\u5176\u4ed6\u9644\u52a0\u6548\u679c\u6642\uff0c\u5168\u968a\u653b\u64ca\u529b 2.5 \u500d" },
  "2413": { name: "\u50be\u57ce\u9032\u8feb \u2027 \u6d6a\u6fe4", description: "\u984d\u5916\u589e\u52a0 3 \u884c\u7b26\u77f3\uff0c\u5927\u5e45\u5ef6\u9577\u79fb\u52d5\u7b26\u77f3\u6642\u9593\u81f3 18 \u79d2\uff0c\u53ef\u4efb\u610f\u79fb\u52d5\u7b26\u77f3\u800c\u4e0d\u6703\u767c\u52d5\u6d88\u9664\uff0c\u4e26\u63d0\u5347\u6c34\u5c6c\u6027\u653b\u64ca\u529b\uff1b\u9054\u6210 10 \u9023\u64ca (Combo) \u6216\u4ee5\u4e0a\u6642\uff0c\u81ea\u8eab\u4ee5\u5916 6 \u661f\u4e3b\u89d2\u7cfb\u5217\u89d2\u8272 (\u4e0d\u5305\u62ec\u5e7b\u7b46\u5e2b\u51f1\u745f\u7433) \u7684\u4e3b\u52d5\u6280\u80fd CD \u6e1b\u5c11 2" },
