  "2487": { name: "\u5f18\u63da\u5927\u7fa9 \u2027 \u9664\u969c", description: "\u5f15\u7206\u5834\u4e0a\u6240\u6709\u98a8\u5316\u7b26\u77f3\u53ca\u51cd\u7d50\u7b26\u77f3\uff1b1 \u56de\u5408\u5167\uff0c\u5149\u5c6c\u6027\u653b\u64ca\u529b\u53ca\u56de\u5fa9\u529b 2.2 \u500d\uff1b\u7576\u968a\u4f0d\u4e2d\u6240\u6709\u6210\u54e1\u7684\u653b\u64ca\u529b\u57fa\u503c\u76f8\u540c\u6642\uff0c\u6240\u6709\u7b26\u77f3\u517c\u5177\u5176\u4ed6\u7b26\u77f3\u6548\u679c" },
  "2489": { name: "\u9006\u7130\u4e4b\u4e00\u6247\u5929\u6daf", description: "\u6728\u5c6c\u6027\u50b7\u5bb3\u53ef\u514b\u5236\u706b\u53ca\u6728\u5c6c\u6027\u76ee\u6a19\uff1b\u6bcf\u6d88\u9664 1 \u7d44\u6728\u7b26\u77f3\uff0c\u500b\u4eba\u8ffd\u6253\u6728\u5c6c\u6027\u653b\u64ca 1 \u6b21\uff0c\u6700\u591a 10 \u6b21 (\u6548\u679c\u6703\u5728\u95dc\u9589\u6b64\u6280\u80fd\u6216\u6b7b\u4ea1\u5f8c\u6d88\u5931)\u3002\u6280\u80fd\u95dc\u9589\u6642\uff0c\u7576\u524d\u6280\u80fd CD \u6e1b\u5c11 2 \uff0c\u4e26\u5c07\u6240\u6709\u7b26\u77f3\u8f49\u5316\u70ba\u6728\u5f37\u5316\u7b26\u77f3" },
  "2491": { name: "\u72c2\u7378\u4fb5\u7565", description: "\u81ea\u8eab\u76f4\u884c\u7684\u7b26\u77f3\u8f49\u5316\u70ba\u6728\u7378\u65cf\u5f37\u5316\u7b26\u77f3\u3002\u968a\u4f0d\u4e2d\u53ea\u6709\u7378\u985e\u6210\u54e1\u6642\uff1a\u65bc\u56de\u5408\u7d50\u675f\u6642\u65bc\u96a8\u6a5f\u5c07 3 \u7c92\u81ea\u8eab\u76f4\u884c\u7684\u7b26\u77f3\u8f49\u5316\u70ba\u6728\u7378\u65cf\u5f37\u5316\u7b26\u77f3\uff0c\u6548\u679c\u6301\u7e8c\u81f3\u6c92\u6709\u6d88\u9664\u7378\u65cf\u7b26\u77f3" },
  "2492": { name: "\u7d5e\u4e4b\u7d55\u6bba", description: "\u6d88\u9664 1 \u7d44 5 \u7c92\u6216\u4ee5\u4e0a\u7684\u7b26\u77f3\u6642\uff0c\u8a72\u56de\u5408\u5168\u968a\u653b\u64ca\u529b\u63d0\u5347\uff1a\u6d88\u9664\u7d44\u6578\u6108\u591a\uff0c\u8a72\u56de\u5408\u5168\u968a\u653b\u64ca\u529b\u63d0\u5347\u6108\u591a\uff0c\u6d88\u9664 3 \u7d44\u53ef\u9054\u81f3\u6700\u5927 2.6 \u500d\uff0c\u6548\u679c\u6703\u5728\u9032\u5165\u4e0b\u4e00\u5c64\u6578 (Wave) \u6642\u6d88\u5931" },
  "2493": { name: "\u5be9\u5224\u4e4b\u5211", description: "\u6c34\u53ca\u5149\u5c6c\u6027\u6a5f\u68b0\u65cf\u6210\u54e1\u7684\u884c\u52d5\u503c\u63d0\u5347\u81f3 100%\u3002\u82e5\u6b64\u6642\u5168\u968a\u6a5f\u68b0\u65cf\u6210\u54e1\u7684\u884c\u52d5\u503c\u9054\u81f3 100%\uff1a\u5c07\u6240\u6709\u7b26\u77f3\u6dfb\u52a0\u70ba\u6a5f\u68b0\u65cf\u7b26\u77f3\uff1b\u8eab\u65c1\u7684\u6c34\u5c6c\u6027\u6a5f\u68b0\u65cf\u53ca\u5149\u5c6c\u6027\u6a5f\u68b0\u65cf\u6210\u54e1\u653b\u64ca\u529b\u63d0\u5347 2.5 \u500d\uff1b\u6548\u679c\u6301\u7e8c\u81f3\u6c92\u6709\u9996\u6279\u6d88\u9664\u5149\u7b26\u77f3" },
  "2499": { name: "\u711a\u66f8\u5751\u5112", description: "\u5c07\u5834\u4e0a\u7684\u7b26\u77f3\u8b8a\u56de\u539f\u59cb\u6a21\u6a23\uff1b\u9ede\u64ca\u5143\u7d20\u6cd5\u9663\u4e0a\u7684\u7b26\u77f3 3 \u6b21\uff0c\u4e26\u5c07\u56fa\u5b9a\u4f4d\u7f6e\u7684\u7b26\u77f3\u8f49\u5316\u70ba\u6240\u9ede\u64ca\u7684\u5f37\u5316\u7b26\u77f3" },
  "2500": { name: "\u7384\u5149\u570d\u57ce\u4e4b\u52e2", description: "\u5149\u7b26\u77f3\u8f49\u5316\u70ba\u5149\u4eba\u65cf\u5f37\u5316\u7b26\u77f3\uff0c\u5176\u4ed6\u7b26\u77f3\u8f49\u5316\u70ba\u5149\u7b26\u77f3\u3002\u82e5\u5168\u968a\u5747\u70ba\u5149\u5c6c\u6027\u4eba\u985e\u6210\u54e1\uff0c1 \u56de\u5408\u5167\uff0c\u9023\u64ca (Combo) \u6578\u76ee\u589e\u52a0 5" },
  "2501": { name: "\u5929\u8f2a\u30fb\u4e94\u8292\u661f\u4e4b\u528d", description: "1 \u56de\u5408\u5167\uff0c\u4ee5\u7d2f\u7a4d\u6230\u9b25\u56de\u5408\u6578 (\u9700\u6d88\u9664\u7b26\u77f3) +1 \u7684\u6578\u91cf\uff0c\u8f49\u5316\u5149\u4eba\u65cf\u7b26\u77f3 (\u6c34\u3001\u5149\u53ca\u5fc3\u4ee5\u5916\u7b26\u77f3\u512a\u5148\u8f49\u63db)\u3001\u984d\u5916\u589e\u52a0\u9023\u64ca (Combo) \u6578\u76ee\u53ca\u8ffd\u6253\u6b21\u6578\uff0c\u6700\u591a\u53ef\u8f49\u5316 5 \u7c92\u5149\u4eba\u65cf\u7b26\u77f3\u3001\u984d\u5916\u589e\u52a0 5 \u9023\u64ca (Combo) \u53ca\u4ee5 50% \u81ea\u8eab\u653b\u64ca\u529b\u8ffd\u6253\u5149\u5c6c\u6027\u653b\u64ca 5 \u6b21\u3002\u767c\u52d5\u6280\u80fd\u5f8c\u5c07\u7d2f\u7a4d\u6230\u9b25\u56de\u5408\u6578\u91cd\u7f6e" },
  "2502": { name: "\u6c6a\u6d0b\u795e\u865f ", description: "\u6c34\u7b26\u77f3\u8f49\u5316\u70ba\u6c34\u795e\u65cf\u5f37\u5316\u7b26\u77f3\uff0c\u540c\u6642\u706b\u53ca\u5fc3\u7b26\u77f3\u8f49\u5316\u70ba\u6c34\u5f37\u5316\u7b26\u77f3" },
  "2503": { name: "\u71be\u71c3\u795e\u865f", description: "\u706b\u7b26\u77f3\u8f49\u5316\u70ba\u706b\u795e\u65cf\u5f37\u5316\u7b26\u77f3\uff0c\u540c\u6642\u6728\u53ca\u5fc3\u7b26\u77f3\u8f49\u5316\u70ba\u706b\u5f37\u5316\u7b26\u77f3" },
  "2504": { name: "\u68ee\u91ce\u795e\u865f", description: "\u6728\u7b26\u77f3\u8f49\u5316\u70ba\u6728\u795e\u65cf\u5f37\u5316\u7b26\u77f3\uff0c\u540c\u6642\u6c34\u53ca\u5fc3\u7b26\u77f3\u8f49\u5316\u70ba\u6728\u5f37\u5316\u7b26\u77f3" },
  "2505": { name: "\u8056\u5149\u795e\u865f", description: "\u5149\u7b26\u77f3\u8f49\u5316\u70ba\u5149\u795e\u65cf\u5f37\u5316\u7b26\u77f3\uff0c\u540c\u6642\u6697\u53ca\u5fc3\u7b26\u77f3\u8f49\u5316\u70ba\u5149\u5f37\u5316\u7b26\u77f3" },
  "2506": { name: "\u9b45\u5f71\u795e\u865f", description: "\u6697\u7b26\u77f3\u8f49\u5316\u70ba\u6697\u795e\u65cf\u5f37\u5316\u7b26\u77f3\uff0c\u540c\u6642\u5149\u53ca\u5fc3\u7b26\u77f3\u8f49\u5316\u70ba\u6697\u5f37\u5316\u7b26\u77f3" },
