  "2537": { name: "\u751f\u547d\u4e4b\u97f3", description: "\u767c\u52d5\u6280\u80fd\u5f8c\uff0c\n\u8a18\u9304\u6bcf\u56de\u5408\u5c0d\u6575\u4eba\u6240\u9020\u6210\u7684\u50b7\u5bb3\n (\u4e0d\u5305\u62ec\u7121\u5c6c\u6027\u50b7\u5bb3\u53ca\u6700\u591a\u8a18\u9304 20 \u5104)\n\n3 \u56de\u5408\u5167\uff0c\u53ef\u96a8\u6642\u95dc\u9589\u6b64\u6280\u80fd\uff0c\u95dc\u9589\u6642\uff1a\n\u4ee5 1% \u7d2f\u8a08\u7e3d\u50b7\u5bb3\n\u21d2 \u5c0d\u6575\u65b9\u5168\u9ad4\u9020\u6210\u7121\u5c6c\u6027\u50b7\u5bb3\n\n\u5426\u5247\uff0c\u6b64\u6280\u80fd\u6703\u5728\u7b2c 3 \u56de\u5408\u5931\u6548" },
