  "2545": { name: "\u6a5f\u68b0\u5be6\u9a57", description: "\u5f15\u7206\u968a\u4f0d\u4e2d\u653b\u64ca\u529b\u57fa\u503c\u6700\u9ad8\u7684 3 \u500b\u6a5f\u68b0\u65cf\u6210\u54e1\u76f4\u884c\u7684\u7b26\u77f3\uff0c\u4ee5\u6389\u843d\u8a72\u76f4\u884c\u6210\u54e1\u5c6c\u6027\u7684\u7b26\u77f3\uff1b\u82e5\u767c\u52d5\u6280\u80fd\u6642\u6211\u65b9\u751f\u547d\u529b\u70ba 1\uff0c\u6a5f\u68b0\u65cf\u6210\u54e1\u7684\u4e3b\u52d5\u6280\u80fd CD \u6e1b\u5c11 2" },
