  "3632": { name: "\u91d1\u679c\u8a98\u6bd2", description: "I. \u6bcf\u56de\u5408\u6240\u6709\n  \u300c\u703e\u6f2b\u52fe\u60d1 \u2027 \u590f\u5a03\u300d\n\u21d2 \u589e\u52a0 1 \u500b\u91d1\u679c\nII. \u82e5\u968a\u9577\u53ca\u6230\u53cb\u5747\u70ba\n  \u300c\u9b54\u6027\u539f\u7f6a \u00b7 \u590f\u5a03\u300d\u6642\n\u21d2 \u6bcf\u56de\u5408\u6240\u6709\n  \u300c\u9b54\u6027\u539f\u7f6a \u00b7 \u590f\u5a03\u300d\n   \u589e\u52a0 1 \u500b\u7981\u679c\nIII. \u5fc5\u5ef6 2 \u79d2\nIV. \u9b54\u65cf\u6210\u54e1\u50b7\u5bb3\n\u21d2 \u53ef\u514b\u5236\u6c34\u53ca\u6728\u5c6c\u6027\u76ee\u6a19\nV. \u82e5\u968a\u4e2d\u6709 \u22652 \u500b\u9b54\u65cf\n    \u6216\u6c34\u5c6c\u6027\u6210\u54e1\n\u24f5 \u9023\u64ca (Ex. Combo\u3001Combo) \n    \u6642\u653b\u64ca\u529b\u63d0\u5347 40%\n\u24f6 \u56de\u5408\u7d50\u675f\u6642\uff0c\n     \u5c07\u6700\u5e95 1 \u6a6b\u884c\u7b26\u77f3\n\u21d2 \u6dfb\u52a0\u70ba\u9b54\u65cf\u7b26\u77f3\n(\u6548\u679c\u6703\u5728\u95dc\u9589\u6b64\u6280\u80fd\n\u6216\u6b7b\u4ea1\u5f8c\u6d88\u5931)\n\u6b64\u6280\u80fd\u53ef\u96a8\u6642\u95dc\u9589\uff0c\u95dc\u9589\u6642\uff1a\n\u24f5 \u81ea\u8eab\u6bcf\u6709 1 \u500b\u91d1\u679c\n\u21d2 \u8a72\u56de\u5408 + 3 Combo\n    (\u6700\u591a + 12 Combo)\n\u24f6 \u82e5\u81ea\u8eab\u6709 4 \u500b\u91d1\u679c\n\u258b \u8a72\u56de\u5408\u6240\u6709\u6210\u54e1\n\u21d2 \u7121\u8996\u300c\u653b\u524d\u76fe\u300d\n\u258b\u7576\u524d\u6280\u80fd CD -2" },
  "3633": { name: "\u65b0\u7d04 \u2027 \u6190\u61ab\u60e1\u9b54\u4e4b\u6b4c", description: "[lv1]\u3010\u968e\u6bb5 1\u3011\nI. \u5f15\u7206\u6240\u6709\u7b26\u77f3\n\u21d2 \u6389\u843d[board=AAEBAAYFDPOW050DDYzprGIA] \u56fa\u5b9a\u6578\u91cf\u53ca\u4f4d\u7f6e[/board]\u7684\n  \u300c\u6697\u53ca\u5fc3\u300d\u5f37\u5316\u7b26\u77f3\n1 \u56de\u5408\u5167\nII. \u6240\u6709\u6210\u54e1\n\u24f5 \u8ffd\u6253 1 \u6b21\n\u24f6 \u7121\u8996\u300c\u56fa\u5b9a\u9023\u64ca\u76fe\u300d\nIII. \u500b\u4eba\u5c0d\u6575\u65b9\u5168\u9ad4\u8ffd\u6253\n\u21d2 \u5996\u7cbe\u985e\u53ca\u3010\u602a\u7269\u5f48\u73e0\u3011\u6210\u54e1\n    \u7e3d\u653b\u64ca\u529b 1.3 \u500d\u7684\u653b\u64ca 1 \u6b21[/lv1]\n\n[lv2]\u3010\u968e\u6bb5 2\u3011\n(CD \u70ba 0 \u5f8c\uff0c\n \u7d2f\u7a4d 2 \u500b\u6230\u9b25\u56de\u5408\u53ef\u767c\u52d5)\n\nI. \u5c07\u5834\u4e0a\u7684\u7b26\u77f3\n\u21d2 \u8b8a\u56de\u539f\u59cb\u6a21\u6a23\nII. \u5f15\u7206\u6240\u6709\u7b26\u77f3\n\u21d2 \u6389\u843d[board=AAEBAAYFDPOW050DDYzprGIA]\u56fa\u5b9a\u6578\u91cf\u53ca\u4f4d\u7f6e[/board]\u7684\n  \u300c\u6697\u53ca\u5fc3\u300d\u5f37\u5316\u7b26\u77f3\n1 \u56de\u5408\u5167\nIII. \u6240\u6709\u6210\u54e1\n\u24f5 \u8ffd\u6253 1 \u6b21\n\u24f6 \u7121\u8996\u300c\u56fa\u5b9a\u9023\u64ca\u76fe\u300d\n\u24f7 \u7121\u8996\u300c\u653b\u524d\u76fe\u300d\nIV. \u500b\u4eba\u5c0d\u6575\u65b9\u5168\u9ad4\u8ffd\u6253\n\u21d2 \u5996\u7cbe\u985e\u53ca\u3010\u602a\u7269\u5f48\u73e0\u3011\u6210\u54e1\n    \u7e3d\u653b\u64ca\u529b 3 \u500d\u7684\u653b\u64ca 1 \u6b21[/lv2]" },
