  "4102": { name: "\u5492\u8a5b\u5e2b\u7684\u529b\u91cf", description: "I. \u9ede\u71c3\u6575\u65b9\u5168\u9ad4\uff0c\n   \u4f7f\u53d7\u5f71\u97ff\u76ee\u6a19\n\u21d2 \u8f49\u70ba\u706b\u5c6c\u6027\uff0c\n    \u6548\u679c\u6301\u7e8c\u81f3\u6575\u4eba\u6b7b\u4ea1\nII. \u5c07\u5de6\u65b9 3 \u76f4\u884c\u7684\u7b26\u77f3\n\u21d2 \u8f49\u5316\u70ba\u56fa\u5b9a\u6578\u91cf\u53ca\u4f4d\u7f6e\u7684\n   \u300c\u6c34\u3001\u706b\u53ca\u6728\u300d\u5f37\u5316\u7b26\u77f3\n1 \u56de\u5408\u5167\nIII. \u81ea\u8eab\n\u24f5 \u653b\u64ca\u529b 6 \u500d\n\u24f6 \u7121\u8996\u300c\u4e94\u5c6c\u76fe\u300d\nIV. \u81ea\u8eab\u653b\u64ca\u8f49\u5316\u70ba\u6c34\u5c6c\u6027" },
