  "4104": { name: "\u53cd\u8f49\u8853\u5f0f", description: "I. \u5b8c\u5168\u56de\u5fa9\u751f\u547d\u529b\nII. \u82e5\u968a\u9577\u70ba\u6697\u5c6c\u6027\u6216\u9b54\u65cf\u6210\u54e1\n\u21d2 \u5237\u65b0\u8b77\u76fe\n1 \u56de\u5408\u5167\nIII. \u6240\u53d7\u50b7\u5bb3\u4e0d\u6703\u4f7f\u4f60\u6b7b\u4ea1\n   (\u5305\u62ec\u300c\u558b\u8840\u5c60\u5200\u300d\u7b49\u6263\u9664\n   \u53ec\u559a\u5e2b\u6307\u5b9a % \u751f\u547d\u529b\u7684\n   \u6575\u6280\u6240\u9020\u6210\u7684\u50b7\u5bb3)\nIV. \u4ee5\u6240\u53d7\u50b7\u5bb3 1,000 \u500d\n\u21d2 \u5c0d\u6575\u65b9\u653b\u64ca\u8005\u9032\u884c\n     \u6697\u5c6c\u6027\u53cd\u64ca\n     (\u6b64\u50b7\u5bb3\u7121\u8996\u9632\u79a6\u529b\u53ca\n     \u300c\u5f37\u5316\u7a81\u7834\u300d)\nV. \u4e0b\u56de\u5408\uff0c\u81ea\u8eab\n\u24f5 \u653b\u64ca\u529b 6 \u500d\n\u24f6 \u8ffd\u6253\u4e94\u5c6c\u653b\u64ca\u5404 1 \u6b21\n\n\u8a3b\uff1a\u6b64\u6280\u80fd\u5728\u9762\u5c0d\u300c\u6263\u9664\u53ec\u559a\u5e2b\u6307\u5b9a % \u751f\u547d\u529b\u300d\u4ee5\u5916\u300c\u9632\u79a6\u5d29\u58de\u300d\u6575\u6280\u6642\uff0c\u4ecd\u6703\u56e0\u751f\u547d\u529b\u4e0d\u8db3\u800c\u5c0e\u81f4\u6b7b\u4ea1\u3002" },
