  "4112": { name: "\u592a\u967d\u4e4b\u661f", description: "I. \u79fb\u9664\u6240\u6709\u7b26\u77f3\n\u21d2  \u6389\u843d[board=AAEBAAYFbdWqha8Ba6rV+tACAA==]\u56fa\u5b9a\u7248\u9762[/board]\u7684\n    \u300c\u706b\u53ca\u5149\u300d\u6a5f\u68b0\u65cf\u5f37\u5316\u7b26\u77f3\nII. \u5c07\u6a5f\u68b0\u65cf\u6210\u54e1\u7684\u4f11\u7720\u72c0\u614b\u53ca\u75b2\u618a\u72c0\u614b\n\u21d2 \u8b8a\u70ba\u4ea2\u596e\u72c0\u614b\nIII. \u6a5f\u68b0\u65cf\u6210\u54e1\n\u21d2 \u589e\u52a0 2 \u56de\u5408\u4ea2\u596e\u72c0\u614b\n1 \u56de\u5408\u5167\nIV. \u6a5f\u68b0\u65cf\u6210\u54e1\u7121\u8996\n\u24f5\u300c\u4e8c\u5c6c\u76fe\u300d\u3001\u300c\u4e09\u5c6c\u76fe\u300d\u3001\n    \u300c\u56db\u5c6c\u76fe\u300d\u3001\u300c\u4e94\u5c6c\u76fe\u300d\n\u24f6\u300c\u7b26\u77f3\u9023\u64ca\u96f6\u5316\u300d\nV. \u82e5\u968a\u9577\u70ba\u300c\u9a55\u967d\u6c38\u8000 \u2027 \u963f\u5716\u59c6\u300d\n\u24f5 \u5c07\u8b77\u76fe\u6e1b\u81f3 1\n\u24f6 \u5c07\u88ab\u6e1b\u53bb\u8b77\u76fe\u503c\u7684 50%\n     \u52a0\u5165\u300c\u9a55\u967d\u6c38\u8000 \u2027 \u963f\u5716\u59c6\u300d\u653b\u64ca\u529b\u57fa\u503c" },
