  "4389": { name: "\u90aa\u6c23\u5bc4\u751f", description: "I. \u6575\u65b9\u5168\u9ad4\u88ab\u5bc4\u751f\uff1a\n   \u6bcf\u56de\u5408\u5c0d\u6bcf\u500b\u6575\u4eba\n   \u9020\u6210\u81ea\u8eab\u56de\u5fa9\u529b\u57fa\u503c\n   100 \u500d\u7684\u7121\u5c6c\u6027\u50b7\u5bb3\n\u21d2 \u4e26\u8f49\u5316\u70ba\u6211\u65b9\u751f\u547d\u529b\uff0c\n    \u6b64\u50b7\u5bb3\u7121\u8996\u9632\u79a6\u529b\u53ca\n    \u6575\u65b9\u6280\u80fd\uff0c\u4e26\u6301\u7e8c\u5230\u6b7b\u4ea1\n1 \u56de\u5408\u5167\nII. \u7121\u8996\u300c\u7634\u6c23\u300d\u3001\u300c\u9ecf\u8150\u300d\nIII. \u968a\u4e2d\u6bcf\u591a 1 \u500b\u3010\u51a5\u6559\u5f92\u3011\u6210\u54e1\n\u21d2 \u984d\u5916\u589e\u52a0 1 \u56de\u5408\u6548\u679c\n\u21d2 \u6700\u591a\u53ef\u6301\u7e8c 3 \u56de\u5408\nIV. \u4ee5\u653b\u524d\u70ae\u64ca\u6216\u653b\u64ca\u50b7\u5bb3\u64ca\u6583\u6575\u4eba\n\u21d2 \u56de\u5408\u7d50\u675f\u6642\uff0c\n    \u5c07\u6240\u6709\u7b26\u77f3\u8f49\u5316\u70ba\u5f37\u5316\u7b26\u77f3" },
