  "4526": { name: "\u8b8a\u8eab", description: "I. \u9084\u539f\u3010\u5b87\u5b99\u5de1\u68ad\u3011\n   \u53ca\u6a5f\u68b0\u65cf\u6210\u54e1\n   \u76f4\u884c\u300c\u788e\u88c2\u300d\u4f4d\u7f6e\nII. \u5c07\u6240\u6709\u7b26\u77f3\n\u21d2 \u8f49\u5316\u70ba\u5f37\u5316\u7b26\u77f3\nIII. \u5c07\u6240\u6709\u7b26\u77f3\n\u21d2 \u6dfb\u52a0\u70ba\u6a5f\u68b0\u65cf\u7b26\u77f3\nIV. \u767c\u52d5\u6280\u80fd\u6642\uff0c\n     \u82e5\u5df2\u7d2f\u8a08\u9996\u6279\u6d88\u9664\n     \u226560 \u7c92\u6a5f\u68b0\u65cf\u7b26\u77f3\n\u21d2 \u8b8a\u8eab\n(\u8b8a\u8eab\u5f8c\u91cd\u7f6e\u81ea\u8eab\u7d2f\u8a08\n\u9996\u6279\u6d88\u9664\u6a5f\u68b0\u65cf\u7b26\u77f3\u6578\u91cf) " },
