  "4604": { name: "\u5fcd\u6cd5 \u2027 \u7dda\u65ac\u884c", description: "I. \u767c\u52d5\u6280\u80fd\u5f8c\uff0c8 \u500b\u4f4d\u7f6e\n\u21d2 \u9644\u52a0\u9ecf\u7d72\u5730\u578b\nII. \u79fb\u52d5\u7b26\u77f3\u6642\u89f8\u78b0\u7684\n   \u300c\u9ecf\u7d72\u300d\u5730\u578b\u6578\u91cf\u6108\u591a\n\u21d2 \u7372\u5f97\u6548\u679c\u6108\u591a\uff1a\n\n\u3010\u22652 \u500b\u3011\n\u258b\u767c\u52d5\u653b\u64ca\u524d\u5c0d\u6575\u65b9\u5168\u9ad4\n\u21d2 \u9020\u6210\u300c\u81ea\u8eab\u653b\u64ca\u529b\n    \u57fa\u503c 8,888 \u500d\u300d\n    \u9ede\u6697\u5c6c\u6027\u50b7\u5bb3\n    (\u6b64\u50b7\u5bb3\u7121\u8996\u9632\u79a6\u529b\n    \u53ca\u300c\u5f37\u5316\u7a81\u7834\u300d)\n\n\u3010\u22654 \u500b\u3011\n\u258b\u3010\u5730\u7344\u6a02\u3011\u6210\u54e1\n\u24f5 \u7121\u8996\u300c\u653b\u524d\u76fe\u300d\n\u24f6 \u7121\u8996\u300c\u9023\u64ca\u76f8\u7b49\u76fe\u300d\n\u24f7 \u9032\u5165 1 \u56de\u5408\u4ea2\u596e\u72c0\u614b\n\n\u3010\u22656 \u500b\u3011\n\u258b\u3010\u6b7b\u5211\u72af\u3011\u53ca\n  \u3010\u65ac\u9996\u884c\u5211\u8005\u3011\n\u21d2 \u6280\u80fd CD -1\n\n\u30108 \u500b\u3011\n\u258b\u9023\u64ca (Combo) \u6642\n\u21d2 \u653b\u64ca\u529b\u63d0\u5347 80%\n\u258b \u82e5\u968a\u9577\u70ba\u300c\u6760\u300d\n\u21d2 \u6240\u53d7\u50b7\u5bb3\u6e1b\u81f3 8\n   (\u5305\u62ec\u300c\u558b\u8840\u5c60\u5200\u300d\u7b49\u6263\u9664\n   \u53ec\u559a\u5e2b\u6307\u5b9a % \u751f\u547d\u529b\u7684\n   \u6575\u6280\u6240\u9020\u6210\u7684\u50b7\u5bb3)\n\n\u89f8\u78b0\u300c\u9ecf\u7d72\u300d\u5730\u578b\n\u53ef\u6301\u7e8c\u6280\u80fd\u6548\u679c" },
  "4605": { name: "\u7d14\u771f\u72e9\u7375", description: "I. \u89e3\u9664\u300c\u7693\u6f54\u4f0a\u59cb \u2027 \u6240\u591a\u746a\u300d\n   \u88ab\u5c01\u9396\u7684\u6280\u80fd\u3001\u300c\u75b2\u618a\u3001\n   \u4f11\u7720\u3001\u98a8\u58d3\u3001\u9ebb\u75fa\u300d\u72c0\u614b\n   (\u6b64\u6280\u80fd\u7121\u8996\u5c01\u9396\u3001\n    \u4f11\u7720\u3001\u98a8\u58d3\u6280\u80fd)\nII. \u5f15\u7206\u6240\u6709\u7b26\u77f3\n\u21d2 \u6389\u843d[board=AAEBAAYFUoeIhIcBUbjB8BBOwKCACE+AgoEgUICEgkBTgJCIgAIA]\u56fa\u5b9a\u7248\u9762[/board]\u7684\n   \u300c\u4e94\u5c6c\u53ca\u5fc3\u300d\u9f8d\u65cf\u5f37\u5316\u7b26\u77f3\n     \u82e5\u968a\u9577\u70ba\u7378\u985e\u6216\u9f8d\u985e\u6210\u54e1\n\u21d2 \u5247\u4e0a\u8ff0\u5f15\u7206\u6548\u679c\u6539\u70ba\u79fb\u9664\nIII. \u82e5\u968a\u9577\u70ba\u300c\u7693\u6f54\u4f0a\u59cb \u2027 \u6240\u591a\u746a\u300d\n\u21d2 \u589e\u52a0 1 \u91cd\u300c\u9435\u58c1\u300d\n1 \u56de\u5408\u5167\nIV.\u300c\u707c\u71b1\u5730\u578b\u300d\u50b7\u5bb3\n\u21d2 \u8f49\u5316\u70ba\u6211\u65b9\u751f\u547d\u529b\nV.\u300c\u4e00\u6b65\u4e00\u50b7\u300d\u50b7\u5bb3\u6e1b\u81f3 0\nVI. \u7378\u985e\u53ca\u9f8d\u985e\u6210\u54e1\u7121\u8996\n\u24f5\u300c\u653b\u524d\u76fe\u300d\n\u24f6\u300c\u6307\u5b9a\u5f62\u72c0\u76fe\u300d\nVII. \u672c\u56de\u5408\u6c92\u6709\u64ca\u6583\u4efb\u4f55\u6575\u4eba\n\u21d2 \u5ef6\u9072\u5168\u9ad4\u6575\u4eba\u884c\u52d5 1 \u56de\u5408\uff0c\n\u3000\u82e5\u968a\u9577\u70ba\u7378\u985e\u6216\u9f8d\u985e\u6210\u54e1\n\u21d2 \u5247\u5ef6\u9072 2 \u56de\u5408\n" },
  "4606": { name: "\u528d\u9aa8\u7194\u6bc0\uff0e\u9748\u667a\u66b4\u8d70", description: "\u81ea\u8eab\u300c\u528d\u92b3\u503c\u300d\u9054\u81f3 100\n\u624d\u80fd\u767c\u52d5\u6b64\u6280\u80fd\n(\u6bcf\u500b\u300c\u7693\u6f54\u4f0a\u59cb \u2027 \u6240\u591a\u746a\u300d\n \u53ea\u80fd\u5728\u6574\u5834\u6230\u9b25\u4e2d\n \u767c\u52d5 1 \u6b21\u6b64\u6280\u80fd)  \uff1a\n\nI. \u6575\u65b9\u5168\u9ad4\u7f6e\u8eab\u300c\u5200\u50b7\u300d\u72c0\u614b\uff1a\n     \u6bcf\u56de\u5408\u6240\u53d7\u50b7\u5bb3 4 \u500d\n     \u6548\u679c\u6301\u7e8c\u81f3\u6b7b\u4ea1\nII. \u7378\u985e\u53ca\u9f8d\u985e\u6210\u54e1\n\u21d2 \u589e\u52a0 3 \u56de\u5408\u4ea2\u596e\u72c0\u614b\nIII. \u7576\u524d\u751f\u547d\u529b\n\u21d2 \u8b8a\u70ba\u7e3d\u751f\u547d\u529b 100%\nIV. \u79fb\u9664\u6240\u6709\u7b26\u77f3\n\u24f5 \u968a\u4f0d\u6210\u54e1\u76f4\u884c\u6389\u843d\u8a72\u6210\u54e1\u7684\n    \u5c6c\u6027\u9f8d\u65cf\u5f37\u5316\u7b26\u77f3\n\u24f6 \u6c92\u6709\u6210\u54e1\u7684\u76f4\u884c\n\u21d2 \u6389\u843d\u5fc3\u9f8d\u65cf\u5f37\u5316\u7b26\u77f3 \n2 \u56de\u5408\u5167\nV.  \u9023\u64ca (Combo) \u6578\u76ee\u56fa\u5b9a\u70ba 100\nVI. \u81ea\u8eab\n\u24f5 \u653b\u64ca\u529b 8 \u500d\n\u24f6 \u7121\u8996\n\u258b\u300c\u9996\u6d88\u7c92\u6578\u76fe\u300d\n\u258b\u300c\u5168\u7248\u6d88\u9664\u76fe\u300d\n\u258b\u300c\u4e8c\u5c6c\u76fe\u300d\u3001\u300c\u4e09\u5c6c\u76fe\u300d\u3001\n   \u300c\u56db\u5c6c\u76fe\u300d\u3001\u300c\u4e94\u5c6c\u76fe\u300d\n\u24f7 \u6839\u64da\u6700\u5f8c\u653e\u624b\u7684\u7b26\u77f3\n\u21d2 \u8ffd\u6253\u8a72\u5c6c\u6027\u653b\u64ca 1 \u6b21\uff0c\n     \u82e5\u6700\u5f8c\u653e\u624b\u7684\u70ba\u5fc3\u7b26\u77f3\n\u21d2 \u5247\u8ffd\u6253\u7121\u5c6c\u6027\u653b\u64ca 1 \u6b21" },
  "4607": { name: "\u61a4\u6012\u91cd\u58d3", description: "I. \u6240\u6709\u6210\u54e1\n\u21d2 \u9032\u5165 1 \u56de\u5408\u4ea2\u596e\u72c0\u614b\nII. \u7378\u985e\u53ca\u9f8d\u985e\u6210\u54e1\n\u21d2 \u589e\u52a0 2 \u56de\u5408\u66b4\u64ca\u72c0\u614b\nIII. \u9ede\u9078\u5143\u7d20\u6cd5\u9663\u4e0a\u7684\u7b26\u77f3 5 \u6b21\n\u21d2 \u5f15\u7206\u6240\u6709\u7b26\u77f3\n\u21d2 \u6389\u843d\u56fa\u5b9a\u7248\u9762\u7684\n     \u6240\u9078\u7378\u65cf\u5f37\u5316\u7b26\u77f3\nIV. \u968a\u9577\u70ba\u7378\u985e\u6216\u9f8d\u985e\u6210\u54e1\n\u21d2 \u89e3\u9664\u300c\u7d50\u754c\u5730\u578b\u300d1 \u56de\u5408\n" },
  "4608": { name: "\u6230\u706b\u4e4b\u5f15", description: "I. \u89e3\u9664\u300c\u5e7d\u9589\u7a7a\u9593\u300d\n\n2 \u56de\u5408\u5167\nII. \u7121\u8996\u300c\u9ecf\u8150\u300d\nIII. \u5168\u968a\u7121\u8996\u300c\u653b\u524d\u76fe\u300d\nIV. \u4ee5\u9f8d\u985e\u6210\u54e1\u89d2\u8272\u7b26\u77f3\n     \u9996\u6b21\u8d77\u624b\n\u21d2 \u5c07\u79fb\u52d5\u7b26\u77f3\u6642\u89f8\u78b0\u7684\n    \u9996 30 \u7c92\u7b26\u77f3\n\u21d2 \u8f49\u5316\u70ba\u8a72\u6210\u54e1\u7684\n    \u5c6c\u6027\u9f8d\u65cf\u5f37\u5316\u7b26\u77f3\nV. \u4ee5\u9f8d\u985e\u4ee5\u5916\u6210\u54e1\u89d2\u8272\u7b26\u77f3\n    \u9996\u6b21\u8d77\u624b\n\u21d2 \u5c07\u79fb\u52d5\u7b26\u77f3\u6642\u89f8\u78b0\u7684\n    \u9996 30 \u7c92\u7b26\u77f3\n\u21d2 \u8f49\u5316\u70ba\u8a72\u6210\u54e1\u7684\n     \u5c6c\u6027\u7a2e\u65cf\u7b26\u77f3\nVI. \u4ee5\u975e\u89d2\u8272\u7b26\u77f3\u9996\u6b21\u8d77\u624b\n\u21d2 \u5c07\u79fb\u52d5\u7b26\u77f3\u6642\u89f8\u78b0\u7684\n     \u9996 30 \u7c92\u7b26\u77f3\n\u21d2 \u8f49\u5316\u70ba\u5fc3\u7b26\u77f3\nVII. \u82e5\u968a\u9577\u70ba\u7378\u985e\u6216\u9f8d\u985e\u6210\u54e1\n\u21d2 II - VI \u984d\u5916\u589e\u52a0 1 \u56de\u5408\u6548\u679c\nVIII. \u82e5\u968a\u9577\u70ba\n      \u300c\u7693\u6f54\u4f0a\u59cb \u2027 \u6240\u591a\u746a\u300d\n\u21d2 II - VI \u984d\u5916\u589e\u52a0 1 \u56de\u5408\u6548\u679c" },
