  "4634": { name: "\u81ea\u7136\u5f8b\u52d5", description: "I. \u81ea\u8eab\u9032\u5165 1 \u56de\u5408\u75b2\u618a\u72c0\u614b\n1 \u56de\u5408\u5167\nII. \u767c\u52d5\u6280\u80fd\u53ca\u56de\u5408\u7d50\u675f\u6642\uff0c\n\u24f5 \u5c07\u6c34\u7b26\u77f3\u8f49\u5316\u70ba\n\u21d2 \u5149\u9f8d\u65cf\u5f37\u5316\u7b26\u77f3\n\u24f6 \u5c07\u706b\u7b26\u77f3\u8f49\u5316\u70ba\n\u21d2 \u6697\u9f8d\u65cf\u5f37\u5316\u7b26\u77f3\nIII. \u968a\u9577\u53ca\u6230\u53cb\u653b\u64ca\u529b 2 \u500d\nIV. \u9f8d\u65cf\u7b26\u77f3\u517c\u5177\n\u21d2 \u6240\u6709\u7a2e\u65cf\u7b26\u77f3\u6548\u679c\nV. \u968a\u4e2d\u6bcf\u591a 1 \u500b\u5149\u5c6c\u6027\u6210\u54e1\n\u21d2 II - IV \u984d\u5916\u589e\u52a0 1 \u56de\u5408\u6548\u679c\n\u21d2 \u6700\u591a\u53ef\u6301\u7e8c 3 \u56de\u5408\nVI. \u82e5\u968a\u9577\u70ba\n   \u300c\u74b0\u5149\u8056\u6230 \u2027 \u6d85\u7d22\u4f0a\u300d\n\u21d2\u300c\u74b0\u5149\u8056\u6230 \u2027 \u6d85\u7d22\u4f0a\u300d\n     \u7121\u8996\u300c\u5341\u5b57\u9650\u76fe\u300d" },
