  "4688": { name: "\u9748\u5b50\u66b4\u8d70", description: "I. \u6d88\u9664\u6240\u6709\u9644\u52a0\u6548\u679c\n1 \u56de\u5408\u5167\nII. \u767c\u52d5\u6280\u80fd\u53ca\u56de\u5408\u7d50\u675f\u6642\n\u21d2 \u5b8c\u5168\u56de\u5fa9\u751f\u547d\u529b\nIII. \u5438\u6536\u672c\u56de\u5408\u6575\u4eba\n   \u9996\u6b21\u300e\u653b\u64ca\u50b7\u5bb3\u3001\n  \u300c\u558b\u8840\u5c60\u5200\u300d\u7b49\u6263\u9664\n   \u53ec\u559a\u5e2b\u6307\u5b9a % \u751f\u547d\u529b\n   \u7684\u6575\u6280\u6240\u9020\u6210\u7684\u50b7\u5bb3\u300f\nIV. \u4ee5\u6240\u5438\u6536\u653b\u64ca\u529b\u7684\n     2,000 \u500d\n\u21d2 \u5c0d\u6575\u65b9\u5168\u9ad4\u9032\u884c\n     \u706b\u5c6c\u6027\u53cd\u64ca\n     (\u6b64\u50b7\u5bb3\u7121\u8996\u9632\u79a6\u529b\u53ca\n     \u300c\u5f37\u5316\u7a81\u7834\u300d)" },
