  "4694": { name: "\u82f1\u96c4\u9738\u9053", description: "2 \u56de\u5408\u5167\nI. \u5168\u968a\u653b\u64ca\u529b 2 \u500d\nII. \u5168\u968a\u7121\u8996\u300c\u9023\u64ca\u76f8\u7b49\u76fe\u300d\nIII. \u968a\u4f0d\u4e0d\u6703\u88ab\u5c01\u9396\u4e3b\u52d5\u6280\u80fd\nIV. \u79fb\u52d5\u7b26\u77f3\u5f8c\uff0c\n     \u5c07\u9996\u6279\u6389\u843d\u7684\u5149\u7b26\u77f3\n\u21d2 \u6dfb\u52a0\u70ba\u300c\u52a0\u8b77\u7b26\u77f3\u300d\nV. \u82e5\u968a\u9577\u70ba\u3010\u8f49\u751f\u53f2\u840a\u59c6\u3011\u6210\u54e1\u6216\n      \u968a\u4e2d\u53ea\u6709\u4eba\u985e\u6210\u54e1\n\u21d2\u300c\u6b63\u5e78\u300d\u4ee5\u5916\u6210\u54e1\n     \u65bc\u56de\u5408\u7d50\u675f\u6642\u6280\u80fd CD -1" },
