  "4740": { name: "\u5168\u8996\u4e4b\u773c", description: "I. \u96fb\u64ca\u6575\u65b9\u5168\u9ad4\uff0c\n   \u4f7f\u53d7\u5f71\u97ff\u76ee\u6a19\n\u24f5 \u7121\u6cd5\u884c\u52d5\n\u24f6 \u8f49\u70ba\u6c34\u5c6c\u6027\n\u6301\u7e8c 1 \u56de\u5408\nII. \u89e3\u9664\u9f8d\u985e\u6210\u54e1\n    \u88ab\u5c01\u9396\u7684\u6280\u80fd\n   (\u6b64\u6280\u80fd\u7121\u8996\u5c01\u9396\u6280\u80fd)\nIII. \u4e2d\u592e\u300c3x4\u300d\u4f4d\u7f6e\n\u21d2 \u51fa\u73fe\u300c\u7d50\u754c\u5730\u578b\u300d1 \u56de\u5408\n1 \u56de\u5408\u5167\nIV. \u9f8d\u985e\u6210\u54e1\u7121\u8996\n\u24f5\u300c\u4e94\u5c6c\u76fe\u300d\n\u24f6\u300c\u53cd\u9996\u6d88\u7b26\u77f3\u76fe\u300d\nV. \u81ea\u8eab\u53ca\u968a\u9577\u653b\u64ca\u529b 10 \u500d\nVI.\u300c\u81ea\u8eab\u53ca\u968a\u9577\u300d\u4ee5\u5916\u6210\u54e1\n\u21d2 \u4e0d\u80fd\u767c\u52d5\u653b\u64ca" },
  "4741": { name: "\u547d\u904b\u8f2a\u76e4", description: "I. \u89e3\u9664\u6575\u4eba\u300c\u96b1\u8eab\u300d\nII. \u5c07\u6240\u6709\u7b26\u77f3\u8f49\u5316\u70ba\n\u21d2 [board=AAEBAAYFCZWwgKwBDOqAmNACC4DP5wMA] \u56fa\u5b9a\u6578\u91cf\u53ca\u4f4d\u7f6e[/board]\u7684\n   \u300c\u706b\u3001\u5149\u3001\u6697\u300d\u5f37\u5316\u7b26\u77f3\n1 \u56de\u5408\u5167\nIII. \u300c\u707c\u71b1\u5730\u578b\u300d\u50b7\u5bb3\u6e1b\u5c11 100%\nIV. \u6240\u6709\u7b26\u77f3\u517c\u5177\u5149\u7b26\u77f3\u6548\u679c\nV. \u706b\u53ca\u6697\u7b26\u77f3\n\u21d2 1 \u7c92\u5373\u53ef\u767c\u52d5\u6d88\u9664\n\u21d2 \u6548\u679c\u6301\u7e8c\u81f3\u6d88\u9664\n    \u226530 \u7c92\u706b\u7b26\u77f3\u6216\n    \u226530 \u7c92\u6697\u7b26\u77f3\nVI. \u6d88\u9664\u706b\u53ca\u6697\u7b26\u77f3\n\u21d2 \u5168\u968a\u7121\u8996\u300c\u9023\u64ca\u76f8\u7b49\u76fe\u300d" },
  "4742": { name: "\u5236\u52dd\u4e4b\u724c", description: "I. \u6d88\u9664\u6240\u6709\u9644\u52a0\u6548\u679c\nII. \u9b45\u60d1\u6575\u65b9\u5168\u9ad4\uff0c\n    \u4f7f\u6575\u65b9\u4e92\u76f8\u6216\u81ea\u6211\u9032\u884c 1 \u6b21\u653b\u64ca\uff0c\n    \u6301\u7e8c 1 \u56de\u5408\n1 \u56de\u5408\u5167\nIII. \u5c07\u79fb\u52d5\u7b26\u77f3\u6642\u89f8\u78b0\u7684\u7b26\u77f3\n\u21d2 \u8f49\u5316\u70ba\u5f37\u5316\u7b26\u77f3\nIV\u3010\u72c2\u6b61\u7684\u6df1\u6df5\u3011\u53ca\u9b54\u65cf\u6210\u54e1\u7121\u8996\n\u24f5\u300c\u9023\u64ca\u76f8\u7b49\u76fe\u300d\n\u24f6\u300c\u4e94\u5c6c\u76fe\u300d\nV. \u9ede\u9078\u5176\u4e2d 1 \u5f35\u5361\u724c\n\u21d2 \u7372\u5f97 1 \u56de\u5408\u6548\u679c\n\n\u203b \u4e0d\u540c\u5361\u724c\u5c0d\u61c9\u4e0d\u540c\u7a2e\u985e\u7b26\u77f3\n\u3010\u6d6a\u6fe4\u53f2\u840a\u59c6\u3011\uff1a\u6c34\n\u3010\u70c8\u708e\u53f2\u840a\u59c6\u3011\uff1a\u706b\n\u3010\u82b1\u8c54\u53f2\u840a\u59c6\u3011\uff1a\u6728\n\u3010\u795e\u8056\u53f2\u840a\u59c6\u3011\uff1a\u5149\n\u3010\u90aa\u9b54\u53f2\u840a\u59c6\u3011\uff1a\u6697\n\u3010\u760b\u982d\u3011\uff1a\u5fc3\n\n\u258b\u5f15\u7206\u8a72\u7a2e\u7b26\u77f3\n\u21d2 \u6389\u843d\u6c34\u9b54\u65cf\u5f37\u5316\u7b26\u77f3\n\u258b\u6d88\u9664\u7b26\u77f3\u5f8c\n\u24f5 \u9996\u6279\u6389\u843d\u8a72\u7a2e\u9b54\u65cf\u5f37\u5316\u7b26\u77f3\n\u24f6 \u8a72\u7a2e\u7b26\u77f3\u517c\u5177\u6240\u6709\u7b26\u77f3\u6548\u679c\n\n(\u6b64\u6280\u80fd\u7121\u8996\u5c01\u9396\u6280\u80fd)" },
