  "4752": { name: "\u5929\u7167", description: "\u81ea\u8eab\u88dd\u5099\u300c\u5fc3\u5200\u30fb\u7121\u57a2\u300d\n\u9f8d\u523b\u6b66\u88dd\u6216\u968a\u4e2d\u6709\n\u300c\u5929\u738b\u5bfa\u66d6\u300d\u624d\u80fd\u767c\u52d5\u6b64\u6280\u80fd\uff1a\nI. \u5c07\u6240\u6709\u7b26\u77f3\u6dfb\u52a0\u70ba\u4eba\u65cf\u7b26\u77f3\nII.\u3010\u9766\u8146\u82f1\u96c4\u3011\u6210\u54e1\n\u21d2 \u589e\u52a0 2 \u56de\u5408\u4ea2\u596e\u72c0\u614b\n2 \u56de\u5408\u5167\nIII. \u5438\u6536\u8a72\u56de\u5408\u6575\u4eba\n      \u9996\u6b21\u300e\u653b\u64ca\u50b7\u5bb3\u3001\n  \u300c\u558b\u8840\u5c60\u5200\u300d\u7b49\u6263\u9664\n    \u53ec\u559a\u5e2b\u6307\u5b9a % \u751f\u547d\u529b\n    \u7684\u6575\u6280\u6240\u9020\u6210\u7684\u50b7\u5bb3\u300f\uff0c\n    \u82e5\u968a\u9577\u70ba\u3010\u9766\u8146\u82f1\u96c4\u3011\u6210\u54e1\n\u21d2 \u5247\u5438\u6536\u6575\u4eba\u6240\u6709\n    \u300e\u653b\u64ca\u50b7\u5bb3\u3001\n   \u300c\u558b\u8840\u5c60\u5200\u300d\u7b49\u6263\u9664\n    \u53ec\u559a\u5e2b\u6307\u5b9a % \u751f\u547d\u529b\n    \u7684\u6575\u6280\u6240\u9020\u6210\u7684\u50b7\u5bb3\u300f\nIV. \u4ee5\u6240\u5438\u6536\u653b\u64ca\u529b\u7684 100 \u500d\n\u21d2 \u56de\u5fa9\u751f\u547d\u529b\uff0c\n     \u82e5\u968a\u9577\u70ba\u3010\u9766\u8146\u82f1\u96c4\u3011\u6210\u54e1\n\u21d2 \u5247\u4ee5 1,000 \u500d\u56de\u5fa9\u751f\u547d\u529b\nV. \u4ee5\u6240\u5438\u6536\u653b\u64ca\u529b\u7684 1,000 \u500d\n\u21d2 \u5c0d\u6575\u65b9\u653b\u64ca\u8005\u9032\u884c\n     \u706b\u5c6c\u6027\u53cd\u64ca\n     (\u6b64\u50b7\u5bb3\u7121\u8996\u9632\u79a6\u529b\u53ca\n    \u300c\u5f37\u5316\u7a81\u7834\u300d)" },
