  "4773": { name: "\u516b\u5c90\u5927\u86c7", description: "I. \u5ef6\u9072\u5168\u9ad4\u6575\u4eba\u884c\u52d5 1 \u56de\u5408\n1 \u56de\u5408\u5167\nII. \u81ea\u8eab\u8ffd\u6253\u6697\u5c6c\u6027\u653b\u64ca 8 \u6b21\nIII.\u3010\u9766\u8146\u82f1\u96c4\u3011\u6210\u54e1\n\u21d2 \u7121\u8996\u300c\u56fa\u5b9a\u9023\u64ca\u76fe\u300d\nIV. \u968a\u4e2d\u3010\u4e9e\u99ac\u62c9\u91cc\u514b\u3011\n     \u6210\u54e1\u6578\u91cf\u6108\u591a\n\u21d2 \u9023\u64ca (Combo) \u6578\u76ee\n     \u56fa\u5b9a\u6108\u591a\uff1a\n    \u6bcf\u6709 1 \u500b\n  \u3010\u4e9e\u99ac\u62c9\u91cc\u514b\u3011\u6210\u54e1\n\u21d2 \u56fa\u5b9a 8 \u9023\u64ca (Combo)\uff0c\n     \u82e5\u968a\u4e2d\u53ea\u6709\u300c\u5929\u738b\u5bfa\u66d6\u300d\n     \u6216\u3010\u4e9e\u99ac\u62c9\u91cc\u514b\u3011\u6210\u54e1\n\u21d2 \u5247\u9023\u64ca (Combo) \u6578\u76ee\n    \u56fa\u5b9a\u70ba 80\nV. \u5c07\u9996\u6b21\u79fb\u52d5\u7b26\u77f3\u6642\u89f8\u78b0\u7684\n     \u9996 8 \u7c92\u7b26\u77f3\u8f49\u5316\u70ba\n\u21d2 \u6697\u9b54\u65cf\u5f37\u5316\u7b26\u77f3\nVI. \u6bcf\u6d88\u9664 1 \u7a2e\u7b26\u77f3\n\u21d2 \u6389\u843d 8 \u7c92\n    \u6697\u9b54\u65cf\u5f37\u5316\u7b26\u77f3\n\u21d2 \u6700\u591a\u53ef\u6389\u843d 48 \u7c92" },
