  "4775": { name: "\u540c\u5fc3\u68cb\u7de3", description: "I. \u9ede\u9078\u5143\u7d20\u6cd5\u9663\u4e0a\u7684\u7b26\u77f3 5 \u6b21\n\u24f5 \u5c07\u53f3\u65b9 3 \u76f4\u884c\u7684\u7b26\u77f3\n\u21d2 \u8f49\u5316\u70ba\u56fa\u5b9a\u6578\u91cf\u53ca\u4f4d\u7f6e\u7684\n    \u6240\u9ede\u9078\u7684\u5f37\u5316\u7b26\u77f3\n\u24f6 \u56de\u5408\u7d50\u675f\u6642\uff0c\n     \u5c07\u5de6\u65b9 3 \u76f4\u884c\u7684\u7b26\u77f3\n\u21d2 \u8f49\u5316\u70ba\u56fa\u5b9a\u6578\u91cf\u53ca\u4f4d\u7f6e\u7684\n    \u6240\u9ede\u9078\u7684\u5f37\u5316\u7b26\u77f3\uff0c\n    \u4ee5\u4e0a\u5faa\u74b0\u5468\u800c\u5fa9\u59cb\nII.\u3010\u9ed1\u5609\u5609\u3011\u3001\u5149\u5c6c\u6027\u53ca\u6697\u5c6c\u6027\u6210\u54e1\n\u24f5 \u5c0d\u6240\u6709\u76ee\u6a19\u7684\u50b7\u5bb3\u984d\u5916 2.5 \u500d\n\u24f6 \u7121\u8996\u300c\u4e8c\u5c6c\u76fe\u300d\u3001\u300c\u4e09\u5c6c\u76fe\u300d\u3001\n    \u300c\u56db\u5c6c\u76fe\u300d\u3001\u300c\u4e94\u5c6c\u76fe\u300d\n(\u6548\u679c\u6703\u5728\u95dc\u9589\u6b64\u6280\u80fd\n\u6216\u6b7b\u4ea1\u5f8c\u6d88\u5931)\n\n\u6b64\u6280\u80fd\u53ef\u96a8\u6642\u95dc\u9589\uff0c\u95dc\u9589\u6642\uff1a\n\u24f5\u300c\u60c5\u5b9a\u68cb\u5c40 \u2027 \u9ed1\u5609\u5609\u300d\u6280\u80fd CD -2\n\u24f6 \u89e3\u9664\u300c\u66b4\u98a8\u300d1 \u56de\u5408\n\u24f7 \u89e3\u9664\u300c\u5e7d\u9589\u7a7a\u9593\u300d\n\u24f8 \u82e5\u968a\u9577\u70ba\u3010\u9ed1\u5609\u5609\u3011\u6210\u54e1\u53ca\n     \u5834\u4e0a\u6709\u6d41\u5149\u7b26\u77f3\n\u21d2 \u6642\u6677\u5132\u6eff FP" },
