  "4823": { name: "\u7d55\u547d\u91d1\u679c", description: "I. \u6bcf\u56de\u5408\u6240\u6709\n \u300c\u703e\u6f2b\u52fe\u60d1 \u2027 \u590f\u5a03\u300d\u53ca\n \u300c\u60d1\u8a00\u566c\u611b \u2027 \u590f\u5a03\u300d\n\u21d2 \u589e\u52a0 1 \u500b\u91d1\u679c\nII. \u5fc5\u7136\u5ef6\u9577\u79fb\u52d5\u7b26\u77f3\u6642\u9593 2.5 \u79d2\nIII. \u9b54\u65cf\u6210\u54e1\u50b7\u5bb3\u53ef\u514b\u5236\u6575\u4eba\nIV. \u9023\u64ca (Ex. Combo\u3001Combo) \u6642\n\u21d2 \u653b\u64ca\u529b\u63d0\u5347 50%\nV. \u968a\u4e2d\u6709 \u2265 2 \u500b\u6c34\u5c6c\u6027\u6216\u9b54\u65cf\u6210\u54e1\n\u21d2 \u767c\u52d5\u6280\u80fd\u53ca\u6bcf\u56de\u5408\u7d50\u675f\u6642\uff0c\n    \u5c07\u6240\u6709\u7b26\u77f3\u6dfb\u52a0\u70ba\u9b54\u65cf\u7b26\u77f3\n(\u6548\u679c\u6703\u5728\u95dc\u9589\u6b64\u6280\u80fd\n\u6216\u6b7b\u4ea1\u5f8c\u6d88\u5931)\n\n\u6b64\u6280\u80fd\u53ef\u96a8\u6642\u95dc\u9589\uff0c\u95dc\u9589\u6642\uff1a\n\u24f5 \u82e5\u81ea\u8eab\u6709\u300c\u91d1\u679c\u300d\n\u21d2\u300c\u60d1\u8a00\u566c\u611b \u2027 \u590f\u5a03\u300d\n    \u6280\u80fd CD -2\n1 \u56de\u5408\u5167\n\u24f6 \u81ea\u8eab\u6bcf\u6709 1 \u500b\u91d1\u679c\n\u21d2 \u8a72\u56de\u5408 + 6 Combo\n    (\u6700\u591a + 24 Combo)\n\u24f7 \u81ea\u8eab\u6709 \u22651 \u500b\u91d1\u679c\n\u21d2 \u5168\u968a\u7121\u8996\n\u258b\u300c\u653b\u524d\u76fe\u300d\n\u258b\u300c\u9023\u64ca\u76f8\u7b49\u76fe\u300d" },
