  "4855": { name: "\u93ae\u5bf6\u4e4b\u7130", description: "I. \u9ede\u9078\u5834\u4e0a\u7b26\u77f3 1 \u6b21\n\u21d2 \u5c07\u6240\u6709\u7b26\u77f3\u8f49\u5316\n    \u8a72\u7a2e\u795e\u65cf\u5f37\u5316\u7b26\u77f3\nII. \u7378\u985e\u3001\u9f8d\u985e\u53ca\u795e\u65cf\u6210\u54e1\n\u21d2 \u9032\u5165 1 \u56de\u5408\u66b4\u6012\u72c0\u614b\n1 \u56de\u5408\u5167\nIII. \u5168\u968a\u7121\u8996\n\u21d2\u300c\u4e8c\u5c6c\u76fe\u300d\u3001\u300c\u4e09\u5c6c\u76fe\u300d\u3001\n    \u300c\u56db\u5c6c\u76fe\u300d\u3001\u300c\u4e94\u5c6c\u76fe\u300d\nIV.\u300c\u4e00\u6b65\u4e00\u50b7\u300d\u50b7\u5bb3\u6e1b\u81f3 1\nV. \u56de\u5408\u7d50\u675f\u6642\n\u21d2 \u5f15\u7206\u6240\u6709\u7b26\u77f3\n\u21d2 \u6389\u843d\u6700\u5f8c\u653e\u624b\u7684\u7b26\u77f3" },
