  "4875": { name: "\u8a8d\u8b58\u963b\u5bb3", description: "I. \u79fb\u9664\u6240\u6709\u7b26\u77f3\n\u21d2 \u6389\u843d[board=AAEBAAYFYMGgkPgBYb6QiIQCXIDBIF2AgkFegISCAV+AiIQCAA==]\u56fa\u5b9a\u7248\u9762[/board]\u7684\n  \u300c\u4e94\u5c6c\u53ca\u5fc3\u300d\u5996\u65cf\u5f37\u5316\u7b26\u77f3\nII. \u81ea\u8eab\u8f49\u63db\u70ba\n\u21d2\u3010\u8a8d\u8b58\u963b\u5bb3\u3011\u6a21\u5f0f\n1 \u56de\u5408\u5167\nIII. \u8ff4\u907f\u6240\u6709\u6575\u4eba\u653b\u64ca\nIV. \u9023\u64ca (Ex. Combo\u3001Combo) \u6642\n\u21d2 \u653b\u64ca\u529b\u63d0\u5347 80%\nV. \u5168\u968a\u7121\u8996\n\u258b\u300c\u53cd\u9996\u6d88\u7b26\u77f3\u76fe\u300d\n\u258b\u300c\u9996\u6d88\u7d44\u6578\u5c6c\u6027\u7b26\u77f3\u76fe\u300d\n(\u6b64\u6280\u80fd\u7121\u8996\u5c01\u9396\u3001\u4f11\u7720\u3001\n\u98a8\u58d3\u3001\u6c89\u9ed8\u6280\u80fd)" },
  "4876": { name: "\u4e9e\u723e \u00b7 \u4fee\u746a (\u96f7\u59c6)", description: "I. \u9ede\u9078\u5143\u7d20\u6cd5\u9663\u4e0a\u7684\u7b26\u77f3 2 \u6b21\n\u21d2 \u79fb\u9664\u6240\u6709\u7b26\u77f3\n\u24f5 \u55ae\u6578\u76f4\u884c\u6389\u843d\n     \u9996\u6b21\u9ede\u9078\u7684\n     \u9b54\u65cf\u5f37\u5316\u7b26\u77f3\n\u24f6 \u96d9\u6578\u76f4\u884c\u6389\u843d\n     \u7b2c 2 \u6b21\u9ede\u9078\u7684\n     \u9b54\u65cf\u5f37\u5316\u7b26\u77f3\nII. \u51cd\u7d50\u6575\u65b9\u5168\u9ad4\uff0c\n    \u4f7f\u53d7\u5f71\u97ff\u76ee\u6a19\n\u24f5 \u8f49\u70ba\u6c34\u5c6c\u6027\n\u24f6 \u7121\u6cd5\u884c\u52d5\n\u6301\u7e8c 1 \u56de\u5408\nIII. \u5c0d\u6575\u65b9\u5168\u9ad4\u9020\u6210 \n\u21d2 1 \u5104\u9ede\u6c34\u5c6c\u6027\u50b7\u5bb3\n    (\u6b64\u50b7\u5bb3\u7121\u8996\u9632\u79a6\u529b\n    \u53ca\u300c\u5f37\u5316\u7a81\u7834\u300d)\n1 \u56de\u5408\u5167\nIV. \u81ea\u8eab\u653b\u64ca\u529b 5 \u500d\nV. \u5168\u968a\u5c0d\u7f6e\u8eab\u51cd\u7d50\u72c0\u614b\u3001\n    \u6c34\u5c6c\u6027\u76ee\u6a19\u7684\u50b7\u5bb3\n    \u984d\u5916 3 \u500d\nVI.\u3010Re:ZERO\u3011\u6210\u54e1\u7121\u8996\n\u24f5\u300c\u4e8c\u5c6c\u76fe\u300d\u3001\u300c\u4e09\u5c6c\u76fe\u300d\u3001\n    \u300c\u56db\u5c6c\u76fe\u300d\u3001\u300c\u4e94\u5c6c\u76fe\u300d\n\u24f6\u300c\u9023\u64ca\u76f8\u7b49\u76fe\u300d\nVII. \u4e0b\u56de\u5408\u6240\u6709\u6210\u54e1\u653b\u64ca\u529b\n     \u8207\u6b64\u56de\u5408\u76f8\u540c" },
  "4877": { name: "\u9b3c\u5316", description: "I. \u9084\u539f\u6240\u6709\u300c\u788e\u88c2\u300d\u7684\u4f4d\u7f6e\nII. \u89e3\u9664\u300c\u66b4\u98a8\u300d1 \u56de\u5408\nIII. \u81ea\u8eab\u9032\u5165 2 \u56de\u5408\u66b4\u6012\u72c0\u614b\n1 \u56de\u5408\u5167\nIV. \u767c\u52d5\u6280\u80fd\u53ca\u56de\u5408\u7d50\u675f\u6642\n\u21d2 \u6240\u6709\u7b26\u77f3\u6dfb\u52a0\u70ba\u9b54\u65cf\u7b26\u77f3\nV. \u767c\u52d5\u6280\u80fd\u6642\uff0c\n    \u82e5\u5df2\u7d2f\u8a08\u9996\u6279\u6d88\u9664\n    \u226550 \u7c92\u7a2e\u65cf\u7b26\u77f3\n\u21d2 \u8b8a\u8eab\n(\u8b8a\u8eab\u5f8c\u91cd\u7f6e\u81ea\u8eab\n\u9996\u6279\u6d88\u9664\u7a2e\u65cf\u7b26\u77f3\u6578\u91cf) " },
  "4878": { name: "\u6d41\u661f\u9318", description: "I. \u9ede\u9078\u5143\u7d20\u6cd5\u9663\u4e0a\u7684\u7b26\u77f3 5 \u6b21\n\u21d2 \u79fb\u9664\u6240\u6709\u7b26\u77f3\n\u21d2 \u6389\u843d\u56fa\u5b9a\u7248\u9762\u7684\n    \u6240\u9ede\u9078\u7684\u9b54\u65cf\u5f37\u5316\u7b26\u77f3\n1 \u56de\u5408\u5167\nII.\u3010Re:ZERO\u3011\u6210\u54e1\u7121\u8996\n\u21d2\u300c\u9996\u6d88\u7c92\u6578\u76fe\u300d\nIII.\u300c\u6708\u4e0b\u7684\u7738\u5149 \u2027 \u9b3c\u5316\u96f7\u59c6\u300d\n\u24f5 \u653b\u64ca\u529b 5 \u500d\n\u24f6 \u7121\u8996\u300c\u5341\u5b57\u9650\u76fe\u300d\nIV. \u81ea\u8eab\u4ee5 1.5 \u500d\u653b\u64ca\u529b\u8ffd\u6253\n\u21d2 \u6700\u5f8c\u653e\u624b\u7684\u7b26\u77f3\n    \u5c6c\u6027\u653b\u64ca 1 \u6b21\uff0c\n    \u82e5\u6700\u5f8c\u653e\u624b\u7684\u70ba\u5fc3\u7b26\u77f3\n\u21d2 \u5247\u8ffd\u6253\u7121\u5c6c\u6027\u653b\u64ca\nV. \u65bc\u4e0b\u56de\u5408\u958b\u59cb\u6642\uff0c\n    \u6839\u64da\u672c\u56de\u5408\u3010Re:ZERO\u3011\n    \u6210\u54e1\u7e3d\u653b\u64ca\u50b7\u5bb3\n\u21d2 \u5c0d\u6575\u65b9\u9020\u6210\u6c34\u53ca\u706b\n     \u5c6c\u6027\u50b7\u5bb3\u5404 1 \u6b21\n  (\u6b64\u50b7\u5bb3\u7121\u8996\n  \u300c\u9996\u6d88\u7c92\u6578\u76fe\u300d\u3001\n  \u300c\u5341\u5b57\u9650\u76fe\u300d\u3001\n  \u300c\u5f37\u5316\u7a81\u7834\u300d\u53ca\u9632\u79a6\u529b)\nVI. \u82e5\u968a\u9577\u70ba\u300c\u96f7\u59c6\u300d\u6216\n\u300c\u6708\u4e0b\u7684\u7738\u5149 \u2027 \u9b3c\u5316\u96f7\u59c6\u300d\n\u24f5 \u5c07\u81ea\u8eab\u4ee5\u5916\u6210\u54e1\u7684\n     \u653b\u64ca\u529b\u57fa\u503c\u6e1b\u81f3 0\n\u24f6 \u5c07\u88ab\u6e1b\u53bb\u653b\u64ca\u529b\u57fa\u503c\n     \u7684 1.5 \u500d\u52a0\u5165\u81ea\u8eab\n    \u653b\u64ca\u529b\u57fa\u503c" },
