  "4881": { name: "\u62c9\u59c6\u7684\u62db\u724c\u83dc", description: "I. \u89e3\u9664\u300c\u4ea1\u547d\u7206\u64ca\u300d\nII. \u5c07\u6211\u65b9\u751f\u547d\u529b\u8b8a\u70ba\n    \u7e3d\u751f\u547d\u529b 100%\nIII. \u5f15\u7206\u706b\u7b26\u77f3\u3001\u96fb\u64ca\u3001\n     \u51cd\u7d50\u3001\u5f31\u5316\u7b26\u77f3\n\u21d2 \u6389\u843d\u706b\u9b54\u65cf\u5f37\u5316\u7b26\u77f3\nIV. \u5f15\u7206\u6728\u7b26\u77f3\u3001\u5316\u8840\u3001\n     \u77f3\u5316\u3001\u51dd\u7d50\u7b26\u77f3\n\u21d2 \u6389\u843d\u6728\u9b54\u65cf\u5f37\u5316\u7b26\u77f3\n1 \u56de\u5408\u5167\nV. \u6211\u65b9\u56de\u5fa9\u529b\u6e1b\u81f3 0\nVI.\u3010Re:ZERO\u3011\u6210\u54e1\u5176\u4e2d\u9020\u6210\n    \u7684\u6700\u5927\u50b7\u5bb3\u8f49\u63db\u70ba\u5168\u968a\n   \u3010Re:ZERO\u3011\u6210\u54e1\u7684\u50b7\u5bb3" },
