  "4898": { name: "\u770b\u4e0d\u898b\u7684\u624b", description: "I. \u89e3\u9664\u300c\u66b4\u98a8\u300d1 \u56de\u5408\nII. \u6575\u65b9\u5168\u9ad4\u88ab\u5bc4\u751f\uff1a\n   \u6bcf\u56de\u5408\u5c0d\u6bcf\u500b\u6575\u4eba\n   \u9020\u6210\u300c\u6575\u4eba\u9632\u79a6\u529b 45 \u500d + \n   123 \u842c\u300d\u7684\u7121\u5c6c\u6027\u50b7\u5bb3\n\u21d2 \u4e26\u8f49\u5316\u70ba\u6211\u65b9\u751f\u547d\u529b\uff0c\n     \u6b64\u50b7\u5bb3\u7121\u8996\u9632\u79a6\u529b\u53ca\n     \u6575\u65b9\u6280\u80fd\uff0c\u4e26\u6301\u7e8c\u5230\u6b7b\u4ea1\nIII. \u5c07\u6240\u6709\u7b26\u77f3\u8f49\u5316\u70ba\n\u21d2 [board=AAEBAAYFYJW1pa0BYerK2tICAA==]\u56fa\u5b9a\u6578\u91cf\u53ca\u4f4d\u7f6e[/board]\u7684\n   \u300c\u6697\u53ca\u5fc3\u300d\u5996\u65cf\u5f37\u5316\u7b26\u77f3\n1 \u56de\u5408\u5167\nIV. \u53ea\u80fd\u6d88\u9664\u9996\u6279\u7b26\u77f3\nV. \u6697\u7b26\u77f3\u9996\u6279 1 \u7c92\n\u21d2 \u5373\u53ef\u767c\u52d5\u6d88\u9664\nVI. \u5168\u968a\u7121\u8996\n\u24f5\u300c\u6293\u624b\u5730\u578b\u300d\n\u24f6\u300c\u4e8c\u5c6c\u76fe\u300d\u3001\u300c\u4e09\u5c6c\u76fe\u300d\u3001\n    \u300c\u56db\u5c6c\u76fe\u300d\u3001\u300c\u4e94\u5c6c\u76fe\u300d\nVII. \u81ea\u8eab\u4ee5\u3010Re:ZERO\u3011\u6210\u54e1\n       14% \u7e3d\u653b\u64ca\u529b\n\u21d2 \u5c0d\u6575\u65b9\u5168\u9ad4\u5f8c\u8ffd\u6253 30 \u6b21\n    (\u9996 5 \u6b21\u5f8c\u8ffd\u6253\u70ba\u4e94\u5c6c\u9806\u5e8f\uff0c\n     \u5176\u5f8c 25 \u6b21\u70ba\u96a8\u6a5f\u5c6c\u6027\u8ffd\u6253)" },
  "4899": { name: "\u7121\u9650\u589e\u6b96", description: "I. \u5168\u968a\n\u24f5 \u653b\u64ca\u529b 2 \u500d\n\u24f6 \u7121\u8996\u300c\u9023\u64ca\u76f8\u7b49\u76fe\u300d\nII. \u767c\u52d5\u6280\u80fd\u53ca\u6bcf\u56de\u5408\u7d50\u675f\u6642\uff0c\n    \u6839\u64da\u5834\u4e0a\u7684\u81ea\u8eab\u5c6c\u6027\u7b26\u77f3\u7684\u6578\u91cf\n\u21d2 \u8f49\u5316\u76f8\u61c9\u7c92\u6578\u7684\n    \u81ea\u8eab\u5c6c\u6027\u7378\u65cf\u5f37\u5316\u7b26\u77f3\n    (\u81ea\u8eab\u5c6c\u6027\u4ee5\u5916\u7b26\u77f3\u512a\u5148\u8f49\u63db)\nIII. \u82e5\u968a\u9577\u70ba\u3010Re:ZERO\u3011\u6216\u7378\u985e\u6210\u54e1\n\u21d2 \u5168\u968a\u7121\u8996\u300c\u8d77\u7d50\u6709\u5e8f\u300d\n(\u6548\u679c\u6703\u5728\u95dc\u9589\u6b64\u6280\u80fd\n\u6216\u6b7b\u4ea1\u5f8c\u6d88\u5931)\n\n\u6b64\u6280\u80fd\u53ef\u96a8\u6642\u95dc\u9589\uff0c\u95dc\u9589\u6642\uff1a\n\u24f5 \u5f15\u7206\u6240\u6709\u7b26\u77f3\n\u21d2 \u6389\u843d[board=AAEBAAYFOcGgkAg6gsGgEDuEgsEgPIiEgkE9kIiEggE+oJCIhAIA]\u56fa\u5b9a\u7248\u9762[/board]\u7684\n   \u300c\u4e94\u5c6c\u53ca\u5fc3\u300d\u7378\u65cf\u7b26\u77f3" },
  "4900": { name: "\u5730\u9748\u52a0\u6301", description: "I. \u9084\u539f\u6240\u6709\u300c\u788e\u88c2\u300d\u7684\u4f4d\u7f6e\nII. \u5c07\u5834\u4e0a\u7684\u7b26\u77f3\n\u21d2 \u8b8a\u56de\u539f\u59cb\u6a21\u6a23\n2 \u56de\u5408\u5167\nIII. \u81ea\u8eab\u653b\u64ca\u529b 10 \u500d\nIV. \u5c07\u5168\u968a\u5c0d\u6575\u65b9\u9020\u6210\n     \u50b7\u5bb3\u7684 80% \n\u21d2 \u8f49\u5316\u70ba\u6211\u65b9\u751f\u547d\u529b\nV. \u79fb\u52d5\u7b26\u77f3\u5f8c\uff0c\n    \u6389\u843d\u7684\u5149\u53ca\u5fc3\u7b26\u77f3\n\u21d2 \u6dfb\u52a0\u70ba\u300c\u52a0\u8b77\u7b26\u77f3\u300d\nVI. \u82e5\u968a\u9577\u70ba\u3010Re:ZERO\u3011\u6210\u54e1\n      \u6216\u968a\u4e2d\u6709\u300c\u62c9\u59c6\u300d\n\u21d2 \u6240\u6709\u6210\u54e1\u7121\u8996\n    \u6307\u5b9a\u6e1b\u50b7\u6297\u6027\u6575\u6280" },
  "4901": { name: "\u5c0d\u77e5\u8b58\u7684\u8caa\u617e", description: "I. \u5c07\u5834\u4e0a\u7684\u7b26\u77f3\n\u21d2 \u8b8a\u56de\u539f\u59cb\u6a21\u6a23\nII. \u51a5\u63a7\u6575\u65b9\u5168\u9ad4\uff0c\n    \u4f7f\u53d7\u5f71\u97ff\u76ee\u6a19\n\u21d2 \u8f49\u70ba\u6697\u5c6c\u6027\uff0c\n    \u6548\u679c\u6301\u7e8c\u81f3\u6575\u4eba\u6b7b\u4ea1\nIII. \u9ede\u9078\u5143\u7d20\u6cd5\u9663\u4e0a\u7684\u7b26\u77f3 1 \u6b21\n\u24f5\u3010\u7b26\u77f3\u7981\u5492 - \u8a72\u7a2e\u7b26\u77f3\u3011\n\u24f6 \u767c\u52d5\u6280\u80fd\u53ca\u6bcf\u56de\u5408\u7d50\u675f\u6642\n\u258b \u79fb\u9664\u8a72\u7a2e\u7b26\u77f3\n\u258b \u5c07\u6240\u6709\u7b26\u77f3\u8f49\u5316\u70ba\u9b54\u65cf\u5f37\u5316\u7b26\u77f3\nIV.\u3010Re:ZERO\u3011\u53ca\u6697\u5c6c\u6027\u6210\u54e1\n\u21d2 \u653b\u64ca\u529b\u53ca\u56de\u5fa9\u529b 2.7 \u500d\nV. \u6bcf\u56de\u5408\u8ff4\u907f\u6bcf\u500b\u6575\u4eba\u7684\u9996\u6b21\u653b\u64ca\nVI.\u3010Re:ZERO\u3011\u6210\u54e1\u7121\u8996\n\u24f5\u300c\u5168\u7248\u6d88\u9664\u76fe\u300d\n\u24f6\u300c\u5168\u6d88\u76fe\u300d\nIII - VI \u6548\u679c\u6703\u5728\u9032\u5165\u4e0b\u4e00\u5c64\u6578 (Wave) \u6642\u6d88\u5931" },
