  "4932": { name: "\u92fc\u93c8\u624b\u6307\u9023\u6253", description: "I. \u89e3\u9664\u3010\u9ec3\u91d1\u7cbe\u795e\u3011\u53ca\u5149\u5c6c\u6027\u6210\u54e1\n   \u88ab\u5c01\u9396\u7684\u6280\u80fd\u3001\u9ebb\u75fa\u72c0\u614b\n   (\u6b64\u6280\u80fd\u7121\u8996\u5c01\u9396\u6280\u80fd)\nII. \u5f15\u7206\u6240\u6709\u7b26\u77f3\n\u24f5 \u968a\u4f0d\u6210\u54e1\u76f4\u884c\u6389\u843d\n     \u56fa\u5b9a\u7248\u9762\u7684\n   \u300c\u968a\u9577\u5c6c\u6027\u53ca\u5fc3\u300d\n    \u4eba\u65cf\u5f37\u5316\u7b26\u77f3\n\u24f6 \u5176\u4ed6\u76f4\u884c\u6389\u843d\u5fc3\u5f37\u5316\u7b26\u77f3\n1 \u56de\u5408\u5167\nIII. \u5168\u968a\u7121\u8996\u300c\u9ed1\u6d1e\u300d\u3001\u300c\u8840\u6d74\u5730\u578b\u300d\nIV. \u81ea\u8eab\u4ee5 25% \u653b\u64ca\u529b\n\u21d2 \u8ffd\u6253\u5149\u5c6c\u6027\u653b\u64ca 25 \u6b21\nV. \u82e5\u968a\u9577\u70ba\u3010\u5e03\u52a0\u62c9\u63d0\u5c0f\u968a\u3011\u6210\u54e1\n\u21d2 \u56de\u5408\u7d50\u675f\u6642\n\u24f5 \u81ea\u8eab\u6280\u80fd CD -5\n\u24f6\u300c\u5e03\u7f85\u8afe \u2027 \u5e03\u52a0\u62c9\u63d0\u8207\u92fc\u93c8\u624b\u6307\u300d\u4ee5\u5916\u7684\n   \u3010\u5e03\u52a0\u62c9\u63d0\u5c0f\u968a\u3011\u6210\u54e1\n\u258b\u6280\u80fd CD -1\n\u258b\u6280\u80fd EP +1" },
