  "4935": { name: "\u5e7d\u6d6e\u4e00\u65cf", description: "\u6d88\u8017 1 \u6ef4\u300c\u6c34\u300d\u4ee5\u767c\u52d5\u6280\u80fd\uff1a\nI. \u7576\u524d\u751f\u547d\u529b\u8b8a\u70ba\u7e3d\u751f\u547d\u529b 100%\nII. \u5c0d\u6575\u65b9\u5168\u9ad4\u9020\u6210\n\u21d2 1 \u5104\u9ede\u6c34\u5c6c\u6027\u50b7\u5bb3 3 \u6b21\n    (\u6b64\u50b7\u5bb3\u7121\u8996\u9632\u79a6\u529b\n    \u53ca\u300c\u5f37\u5316\u7a81\u7834\u300d)\nIII. \u9ede\u9078 3 \u76f4\u884c\u7684\u7b26\u77f3\u4e26\u79fb\u9664\n\u21d2 \u6389\u843d\u6c34\u5996\u65cf\u5f37\u5316\u7b26\u77f3\nIV. \u6bcf\u9ede\u9078 1 \u6b21\u3010JoJo\u7684\u5947\u5999\u5192\u96aa\u3011\n     \u6216\u5996\u7cbe\u985e\u6210\u54e1\u76f4\u884c\n\u21d2 \u8a72\u6210\u54e1\u589e\u52a0 1 \u56de\u5408\u4ea2\u596e\u72c0\u614b\n1 \u56de\u5408\u5167\nV. \u5168\u968a\u653b\u64ca\u529b 2 \u500d\nVI. \u5168\u968a\u56de\u5fa9\u529b\u8b8a 0" },
  "4936": { name: "\u5929\u5802\u4e4b\u9580", description: "I. \u5c07\u5834\u4e0a\u7684\u7b26\u77f3\n\u21d2 \u8b8a\u56de\u539f\u59cb\u6a21\u6a23\nII. \u9ede\u9078\u5143\u7d20\u6cd5\u9663\u4e0a\u7684\u5c6c\u6027\u7b26\u77f3 1 \u6b21\n\u21d2 \u6575\u65b9\u5168\u9ad4\n\u24f5 \u8f49\u63db\u70ba\u8a72\u5c6c\u6027\n\u24f6 \u653b\u64ca\u529b\u6e1b\u81f3 0\n\u6301\u7e8c 1 \u56de\u5408\n2 \u56de\u5408\u5167\nIII. \u767c\u52d5\u6280\u80fd\u53ca\u6bcf\u56de\u5408\u7d50\u675f\u6642\n\u21d2 \u6240\u6709\u7b26\u77f3\u8f49\u5316\u70ba\n    [board=AAEBAAYFCsegkDgLuJCIxAMNgM/nAwA=]\u56fa\u5b9a\u6578\u91cf\u53ca\u4f4d\u7f6e[/board]\u7684\n  \u300c\u6728\u3001\u5149\u53ca\u5fc3\u300d\u5f37\u5316\u7b26\u77f3\nIV. \u5168\u968a\u653b\u64ca\u529b\u53ca\u56de\u5fa9\u529b 2 \u500d\nV. \u81ea\u8eab\u53ca\u300c\u5ee3\u7028\u5eb7\u4e00\u8207\u8ff4\u97f3\u4e09\u865f\u300d\n\u21d2 \u653b\u64ca\u529b 2 \u500d\nVI.\u300c\u6771\u65b9\u4ed7\u52a9\u8207\u760b\u72c2\u947d\u77f3\u300d\n\u21d2 \u4e0d\u80fd\u767c\u52d5\u653b\u64ca\nVII.\u3010\u9ec3\u91d1\u7cbe\u795e\u3011\u6210\u54e1\n\u21d2 \u7121\u8996\u300c\u4e8c\u5c6c\u76fe\u300d\u3001\u300c\u4e09\u5c6c\u76fe\u300d\u3001\n   \u300c\u56db\u5c6c\u76fe\u300d\u3001\u300c\u4e94\u5c6c\u76fe\u300d" },
  "4937": { name: "\u7b2c\u4e00\u70b8\u5f48 \u2027 \u6bba\u624b\u7687\u540e", description: "I. \u9ede\u9078\u5834\u4e0a\u7684\u7b26\u77f3 1 \u6b21\n\u21d2 \u5f15\u7206\u8a72\u7a2e\u7b26\u77f3\n\u21d2 \u6389\u843d\u8a72\u7a2e\u7b26\u77f3\u4ee5\u5916\u7684\n    \u4eba\u65cf\u5f37\u5316\u7b26\u77f3\n2 \u56de\u5408\u5167\nII. \u6bcf\u56de\u5408\u4ee5\u6575\u65b9\u6240\u53d7\u50b7\u5bb3\u7684\n    330% (\u4e0d\u5305\u62ec\u7121\u5c6c\u6027\u50b7\u5bb3) \n    \u5c0d\u6575\u65b9\u518d\u7206\u767c\u706b\u5c6c\u6027\u50b7\u5bb3\uff0c\n    \u6b64\u50b7\u5bb3\u7121\u8996\u9632\u79a6\u529b\u53ca\n    \u65bc\u6bcf\u4e00\u5c64\u6578 (Wave) \u91cd\u7f6e\nIII. \u6548\u679c\u7d50\u675f\u6642\n\u21d2 \u5f15\u7206\u6240\u6709\u7b26\u77f3\n\u21d2 \u6389\u843d\u8a72\u7a2e\u7b26\u77f3" },
