  "4969": { name: "\u5e73\u5747\u5f8b\u9375\u76e4\u66f2\u96c6", description: "I. \u89e3\u9664\u795e\u65cf\u53ca\u9b54\u65cf\u6210\u54e1\n  \u300c\u4f11\u7720\u3001\u6c89\u9ed8\u300d\u72c0\u614b\n (\u6b64\u6280\u80fd\u7121\u8996\u4f11\u7720\u3001\u6c89\u9ed8\u6280\u80fd)\nII. \u9ede\u9078\u5834\u4e0a\u7684\u7b26\u77f3 2 \u6b21\n\u21d2 \u5c07\u8a72\u7b26\u77f3\u6a6b\u884c\u7684\u7b26\u77f3\n    \u8f49\u5316\u70ba\u300c\u81ea\u8eab\u5c6c\u6027\n    \u795e\u65cf\u97f3\u6a02\u7b26\u77f3\u300d\n1 \u56de\u5408\u5167\nIII. \u9023\u64ca (Combo) \u6578\u76ee\n\u21d2 \u56fa\u5b9a\u70ba 12\nIV. \u795e\u65cf\u53ca\u9b54\u65cf\u6210\u54e1\n\u21d2 \u7121\u8996\u300c\u9023\u64ca\u76f8\u7b49\u76fe\u300d\nV.\u3010\u53e4\u5178\u907a\u8b5c\u3011\u6210\u54e1\n\u21d2 \u7121\u8996\u300c\u6575\u4eba\u6e1b\u50b7\u72c0\u614b\u300d\nVI. \u9023\u64ca (Ex. Combo\u3001Combo) \u6642\u653b\u64ca\u529b\u63d0\u5347 120%" },
