  "4973": { name: "\u6b98\u8650\u5c60\u622e", description: "I. \u9f8d\u985e\u4ee5\u5916\u6210\u54e1\n\u21d2 \u9032\u5165 6 \u56de\u5408\u3010\u932e\u7e1b - \u6280\u80fd\u3011\nII. \u81ea\u8eab\u9032\u5165 6 \u56de\u5408\u300c\u6b9e\u547d\u8f2a\u8ff4\u300d\n6 \u56de\u5408\u5167\nIII. \u968a\u4e2d\u6bcf\u6709 1 \u500b\u9f8d\u985e\u4ee5\u5916\u7a2e\u65cf\n\u21d2 \u5168\u968a\u653b\u64ca\u529b\u63d0\u5347\n\u21d2 2 \u500b\u9f8d\u985e\u4ee5\u5916\u7a2e\u65cf\n    \u53ef\u9054\u81f3\u6700\u5927 4.2 \u500d\nIV. \u767c\u52d5\u6280\u80fd\u53ca\u6bcf\u56de\u5408\u7d50\u675f\u6642\uff0c\n     \u5c07\u6240\u6709\u7b26\u77f3\u8f49\u5316\u70ba\u56fa\u5b9a\u6578\u91cf\u53ca\u4f4d\u7f6e\u7684\n   \u300c\u81ea\u8eab\u5c6c\u6027\u53ca\u5fc3\u300d\u9f8d\u65cf\u5f37\u5316\u7b26\u77f3" },
