  "4977": { name: "\u9b54\u5c0e\u4e4b\u6d41", description: "I. \u767c\u52d5\u6280\u80fd\u53ca\u6bcf\u56de\u5408\u7d50\u675f\u6642\n\u21d2 \u5c07\u6240\u6709\u7b26\u77f3\u6dfb\u52a0\u70ba\u9f8d\u65cf\u7b26\u77f3\nII. \u9f8d\u985e\u6210\u54e1\n\u24f5 \u5c0d\u6240\u6709\u76ee\u6a19\u7684\u50b7\u5bb3\u984d\u5916 2.5 \u500d\n\u24f6 \u7121\u8996\n\u258b\u300c\u5168\u7248\u6d88\u9664\u76fe\u300d\n\u258b\u300c\u653b\u524d\u76fe\u300d\n(\u6548\u679c\u6703\u5728\u95dc\u9589\u6b64\u6280\u80fd\u6216\u6b7b\u4ea1\u5f8c\u6d88\u5931)\n\n\u6b64\u6280\u80fd\u53ef\u96a8\u6642\u95dc\u9589\uff0c\u95dc\u9589\u6642\uff1a\nI.\u300c\u7693\u8000\u73c0\u706b \u2027 \u523b\u743f\u300d\u4ee5\u5916\u7684\u9f8d\u985e\u6210\u54e1\n\u24f5 \u6280\u80fd CD -2\n\u24f6 \u6280\u80fd EP +2\nII. \u79fb\u9664\u6240\u6709\u7b26\u77f3\n\u21d2 \u6389\u843d[board=AAEBAAYFUcGggkFSgsGEggFOhIKJhAJPuICAOFCAnHAA]\u56fa\u5b9a\u7248\u9762[/board]\u7684\u4e94\u5c6c\u9f8d\u65cf\u5f37\u5316\u7b26\u77f3\n1 \u56de\u5408\u5167\nIII. \u9f8d\u985e\u6210\u54e1\u7684\u653b\u64ca\u529b\u53ca\n     \u56de\u5fa9\u529b\u57fa\u503c\u6e1b\u81f3 0\nIV. \u5c07\u88ab\u6e1b\u53bb\u653b\u64ca\u529b\u53ca\n     \u56de\u5fa9\u529b\u57fa\u503c\u7e3d\u548c\u5206\u5225\u52a0\u5165\n\u21d2 \u81ea\u8eab\u3001\u9f8d\u985e\u300c\u968a\u9577\u53ca\u6230\u53cb\u300d\n     \u7684\u653b\u64ca\u529b\u57fa\u503c\nV. \u9f8d\u985e\u6210\u54e1\u7684\u653b\u64ca\u50b7\u5bb3\u7121\u8996\n\u24f5 \u6307\u5b9a\u6e1b\u50b7\u6297\u6027\u6575\u6280\n\u24f6 \u6575\u4eba\u6e1b\u50b7\u72c0\u614b" },
  "4982": { name: "\u6ab8\u6c23\u8feb\u4eba", description: "I. \u9b54\u65cf\u6210\u54e1\u7684\u653b\u64ca\u50b7\u5bb3\n\u21d2 \u7121\u8996\u300c\u8d77\u7d50\u6709\u5e8f\u300d\nII.\u300c\u7d05\u984f\u6555\u4ee4 \u2027 \u6797\u9edb\u7389\u300d\u3001\n   \u300c\u6ab8\u53ef\u601d\u8b70 \u2027 \u6797\u9edb\u7389\u300d\u3001\n   \u300c\u9a45\u5f79\u5f8b\u4ee4 \u2027 \u8cc8\u5bf6\u7389\u300d\u53ca\n   \u300c\u7403\u7f8e\u4e4b\u6c34 \u2027 \u8cc8\u5bf6\u7389\u300d\n\u24f5 \u653b\u64ca\u529b 3 \u500d\n\u24f6 \u7121\u8996\u300c\u5341\u5b57\u9650\u76fe\u300d\n(\u6548\u679c\u6703\u5728\u95dc\u9589\u6b64\u6280\u80fd\n\u6216\u6b7b\u4ea1\u5f8c\u6d88\u5931)\n\n\u6b64\u6280\u80fd\u53ef\u96a8\u6642\u95dc\u9589\uff0c\u95dc\u9589\u6642\uff1a\n\u24f5 \u9ede\u9078\u5834\u4e0a\u7b26\u77f3 6 \u6b21\n\u21d2 \u5c07\u6240\u6709\u7b26\u77f3\u8f49\u5316\u70ba\n     \u56fa\u5b9a\u6578\u91cf\u53ca\u4f4d\u7f6e\u7684\n     \u6240\u9ede\u9078\u7684\u9b54\u65cf\u5f37\u5316\u7b26\u77f3\uff0c\n    \u82e5\u968a\u9577\u70ba\u300c\u7d05\u984f\u6555\u4ee4 \u2027 \u6797\u9edb\u7389\u300d\n\u21d2 \u5247\u4e0a\u8ff0\u8f49\u5316\u6548\u679c\u6539\u70ba\u79fb\u9664\n\u24f6 \u300c\u7d05\u984f\u6555\u4ee4 \u2027 \u6797\u9edb\u7389\u300d\u3001\n   \u300c\u6ab8\u53ef\u601d\u8b70 \u2027 \u6797\u9edb\u7389\u300d\u3001\n   \u300c\u9a45\u5f79\u5f8b\u4ee4 \u2027 \u8cc8\u5bf6\u7389\u300d\u53ca\n   \u300c\u7403\u7f8e\u4e4b\u6c34 \u2027 \u8cc8\u5bf6\u7389\u300d\n\u21d2 \u6280\u80fd CD -2" },
